INSERT INTO `BlogDetails` VALUES (1,'Test Page','Test','Test Page','test-page','<p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><h1>Test Page</h1><p><br></p><h2>Algodonales</h2><p><br></p><p><strong>Algodonales</strong> is a city located in the province of <a href=\"https://en.wikipedia.org/wiki/C%C3%A1diz_(province)\" rel=\"noopener noreferrer\" target=\"_blank\">Cádiz</a>, Spain. According to the 2002 <a href=\"https://en.wikipedia.org/wiki/Census\" rel=\"noopener noreferrer\" target=\"_blank\">census</a>, the city has a population of 5,607 inhabitants. The nearest cities are <a href=\"https://en.wikipedia.org/wiki/Zahara_de_la_Sierra\" rel=\"noopener noreferrer\" target=\"_blank\">Zahara de la Sierra</a> and <a href=\"https://en.wikipedia.org/wiki/Olvera\" rel=\"noopener noreferrer\" target=\"_blank\">Olvera</a>. Algodonales is located in the <a href=\"https://en.wikipedia.org/w/index.php?title=Sierra_de_Lijar&amp;action=edit&amp;redlink=1\" rel=\"noopener noreferrer\" target=\"_blank\">Sierra de Lijar</a> within the <a href=\"https://en.wikipedia.org/wiki/Sierra_de_Grazalema\" rel=\"noopener noreferrer\" target=\"_blank\">Sierra de Grazalema</a>.</p>',1,'Experience','2020-09-12 04:46:18','2020-11-17 06:17:12'),(2,'Test 2','Test 2','Test 2','test-2','<p><img src=\"https://nyc3.digitaloceanspaces.com/vegvisits/images/upload/email%20notifications%20-%20step%201%20%28cropped%29.png\"></p><p><br></p><p><img src=\"https://nyc3.digitaloceanspaces.com/vegvisits/images/contentManagement/69cd92b57f232816740509fa2f193fb0.png\"></p><p><br></p><p><br></p><p><img src=\"https://nyc3.digitaloceanspaces.com/vegvisits/images/contentManagement/7159f14f2049a58d49463ed10338d753.png\"></p><p><br></p><p><img src=\"Image ([{&quot;fieldname&quot;:&quot;file&quot;,&quot;originalname&quot;:&quot;email notifications - step 1 (cropped).png&quot;,&quot;encoding&quot;:&quot;7bit&quot;,&quot;mimetype&quot;:&quot;image/png&quot;,&quot;destination&quot;:&quot;./images/contentManagement/&q