INSERT INTO `Listing` VALUES (1,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','2',NULL,NULL,3,3,3,NULL,'US','763 Massachusetts Avenue',NULL,'Middlesex County','MA','02420','42.42703074607657','-71.20063239836423',1,'America/New_York','2019-03-27 09:45:41','2023-02-21 05:09:08','Off-grid it House and stunning view ','The Off-grid itHouse is an architecturally significant house, recently noted by Dwell as one of the \'Best Homes in America\' and in the Los Angeles Times as one of the best houses of all time in Southern California. The Off-grid itHouse is one of 10 IT Houses built in California, which have received much acclaim such as the Western Home award sponsored by Sunset magazine. Also noted as one of the top 10 airbnb rentals worldwide. This is the prototype for the pre-engineered system known as the IT House.\n\nThe house is 100% off-grid, powered by solar panels for energy and hot water, and is located in a pristine remote valley in the beautiful California high desert. The house observes key green principals of smaller footprint, minimal disturbance to the natural beauty of the surrounding landscape, use of renewable resources, and living simply and minimally.\n\nThe setting of the house is remote and serene, a quiet refuge from everything, free from distractions. Amazing views and vistas in all directions.\n\nPerfect for design or green aficionados, writers or those needing a secluded quiet getaway.',57,'request',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'fe217eb155be81be9446fd6beac212a9','2021-05-28 14:57:00','https://www.airbnb.com/rooms/21379053/reviews'),(2,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'0','1',NULL,NULL,2,2,2,NULL,'US','Guizhou Province Architectural Design & Research Institute, Nanming, , , /','','YunYan','Guizhou','551400','26.8429645','107.2902839',1,'Asia/Shanghai','2019-03-27 09:50:28','2021-11-24 05:52:19','Classic Harlem Brownstone - NYC',' Your Master Bedroom is located on the top floor of a classic Harlem brownstone, with a full guests-shared kitchen and bath. The home is located on Sugar Hill and is across the street from St. Nicholas Park and Hamilton Grange.\n\nThe Master Bedroom is on the top floor of a classic Harlem brownstone, build in 1901. It is gorgeous and spacious, facing the front of the house. You will have soft light in the morning, and a wonderful view of the city lights at night.\n\nPop out to the balcony or across the street to the park for some fresh air! Hamilton Heights, where the home is located, is a fun neighborhood with great fine dining, brunch and tasty takeout! You will have plenty of options for restaurants, bars, music venues and historical landmarks to visit during your stay.\n\nOnce home, enjoy the peace and quite of Hamilton Terrace. This beautiful and historic block is a quaint residential enclave you\'ll love at first sight!\n\nGuest access\n\nGuest have complete access to the full kitchen and full bath.',45,'instant',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'59ff51dccdd5641187c2748fd2998af9','2021-11-24 05:52:19','https://www.airbnb.de/rooms/34928560/reviews'),(3,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'0','3',NULL,NULL,3,5,2.5,NULL,'GB','76 Russell Rd, ',NULL,'Nottingham','UK','NG1 5AW','52.9550908','-1.1583049',1,'Europe/London','2019-03-27 09:54:02','2021-06-03 06:42:22','Immaculate Lakefront Condo w/boat slip-THIS IS IT!','Whether you need a romantic getaway for two, a family fun week at the lake, or a fisherman\'s weekend, Smith Mountain Lake & our penthouse condo has it all just steps from the water. From sitting on the deck watching the sunset over the water while enjoying your favorite beverage, to drifting off to sleep cuddled up in our crisp linens after a day on the lake - Come for a visit - fall in love for a lifetime!',55,'request',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,'2021-06-03 05:36:20','https://www.airbnb.com/rooms/48523518/reviews'),(4,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','4',NULL,NULL,4,4,4,NULL,'US','328 East Fir Avenue, ',NULL,'Atwater','CA','90001','37.3456814','-120.5913511',1,'America/Los_Angeles','2019-03-27 09:56:36','2020-08-18 12:50:18','Adorable townhouse near MFL train & hipster spots','Relax in this adorable and cozy little Philly row house in the calm end of Fishtown. Steps from great coffee, cute independent shops and galleries, a stones throw from more hipster amenities, food and nightlife throughout Fishtown and Northern Liberties. And just a quick ride away from Old City, Center City or the airport.\n\nFull kitchen - Laundry - Patio - Free unlimited street parking all around and easy loading area right out front',38,'request',1,NULL,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(5,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,NULL,'3',NULL,NULL,3,3,3,NULL,'GB','Basse Normandie, Rue Verte, ',NULL,'Hérouville-Saint-Clair','France','75116','49.205084','-0.318614',1,'Europe/Paris','2019-03-27 10:03:30','2023-02-21 05:09:08','Historic Georgian Lakeside Mansion 500 acre Park','This 250 year old delightful and spacious Georgian Menagerie - a replica of that built for Marie Antoinette at Palace of Versailles - is set within 10 acres of private grounds in a 500 acre country park. Sleep in a four poster bed, handmade from oak gifted to the owners by Prince Charles; one of 5 bedrooms available (with a further 2 by separate negotiation)',33,'request',1,NULL,1,5,'Vegan','No',NULL,NULL,'Just a short test\n\nabout this and that\nor everything\n\n\n\nHow does it look like?',NULL,NULL,NULL,0,'13e2a885f384bb749284dbb1d1a9806c','2021-06-03 07:24:00','https://www.airbnb.com/rooms/34200604/reviews'),(6,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','2',NULL,NULL,2,2,2,NULL,'GB','Oristano Stazione F.s., Oristano, ','','Province of Oristano','Italy','09170','39.90105570554223','8.60587392065429',1,'Europe/Rome','2019-03-27 10:07:00','2022-10-29 06:42:07','Lux LoftApartment Nr City Centre with GatedParking','A ground floor light filled spacious apartment with amazing décor perfect for singles, couples, a romantic retreat, a group of friends, families and business travel. A stone\'s throw from City Centre with easy quick transport links or walking. 15/20 min walk to City Centre . 10 min walk to Cardiff City Stadium. The stunning galleried bedroom area is on a mezzanine level overlooking a large living area. Secure Private Parking and Bike Shed in gated courtyard and outside seating area.',27,'request',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'308809a017492ec6e577bd140ec798c1',NULL,NULL),(7,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','5',NULL,NULL,6,4,4,NULL,'GB','69 Commercial Street',NULL,'Greater London','England','E1 7NE','51.51743291864772','-0.07390837724608446',1,'Europe/London','2019-03-27 10:09:22','2021-04-10 17:00:00','Historic and Stunning, Large Central Bedford House','Amazing Georgian home which can accommodate several families (up to 20+): roaring fires, kitchen range vast living rooms (can be candlelit throughout), third-acre garden; lawn tennis, swimming, piano. Our home is in the centre of Bedford, close for shopping, a huge variety of restaurants and pubs. A five minute walk to the town and beautiful river beyond; less to the bus station, and ten to the railway station with easy access to London (35 minutes) and a short drive (45 minutes) to Cambridge.',NULL,'request',1,NULL,1,5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'425e55c189657729d16f074ca6d1cdeb',NULL,NULL),(9,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,'1','1',NULL,NULL,1,1,1,NULL,'DE','6 Karweg',NULL,'Grainau','BY','82491','47.466593838758826','11.043457492065434',1,'Europe/Berlin','2020-08-03 04:42:21','2023-02-21 05:09:08','Test Grainau','Waxenstein view',NULL,'request',1,NULL,1,5,'Vegan','Yes',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL),(11,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',NULL,NULL,NULL,'1',NULL,NULL,2,1,0.5,NULL,'GB','86 Crown Street',NULL,'Pet