INSERT INTO `Reviews` VALUES (2,49,5,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','2db74700-b5dc-11ea-ae50-ddbe5a0ce374','Hope he is back soon again :)',5,NULL,1,0,'2020-07-09 15:29:25','2020-07-09 15:29:25',0,1,'true',NULL,NULL,NULL),(4,0,1,'8b16c890-c205-11e6-a2c7-4195de507451','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My admin review',4,NULL,0,0,'2020-11-02 16:41:36','2020-11-02 16:41:36',1,1,NULL,NULL,NULL,NULL),(903,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne, moderne und hochwertige Wohnung. Die Gastgeberin ist sehr herzlich und kommikativ. War ein schöner Aufenthalt! (Airbnb review)',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-14 05:42:39',0,1,NULL,'Long-Nong','https://www.airbnb.de/rooms/48268802/reviews','April 2021'),(904,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Aufenthalt',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Cindy','https://www.airbnb.de/rooms/48268802/reviews','März 2021'),(905,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich hatte leider einen sehr kurzen Aufenthalt, da ich lediglich auf der Durchreise war. Allerdings kann ich die Location von Elsa nur empfehlen... Alles sehr schick und sauber... Aber vor allem sehr Herzlich... Würde wieder kommen...',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Andy','https://www.airbnb.de/rooms/48268802/reviews','März 2021'),(906,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gute Lage, sehr nette Gastgeberin. Leider war ich nur für kurze Zeit Gast, ich kann mir aber gut vorstellen, dass man dort auch eine längere Zeit verbringen kann. Nur zu empfehlen.',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Christian','https://www.airbnb.de/rooms/48268802/reviews','Februar 2021'),(965,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne ruhige und zentrale Lage, sehr sauber, ausreichende Ausstattung- für einen Kurztrip empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Madita','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),(966,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super sauber und ein toller Ausgangpunkt für Wanderungen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Anna','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),(967,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolute Empfehlung! Die Wohnung war super sauber und gut gepflegt, die Küche war toll ausgestattet, der Blick auf den Gipfel war wunderschön. Gemütlich, man kann toll entspannen, die Lage ist perfekt, man kann super parken und ziemlich alles fußläufig in guter Zeit erreichen. Wir sind absolut zufrieden und dankbar GP in dieser Unterkunft erleben zu dürfen! Die Gastgeber sind auch freundlich und nett und stellen immer sicher, dass man alles hat, was man braucht, sind gut erreichbar und haben immer ein Lächeln parat. Gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Mirela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(968,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','saubere Unterkunft, toller Ausblick vom Balkon. Sehr empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Patrick','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(969,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war für unseren Aufenthalt in Ordnung.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Lea','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(970,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wie beschrieben.Sie ist sehr sauber und enthält alles was man benötigt. Klein aber fein. Die Aussicht auf die Olympiaschanze vom Balkon ist toll. Wir haben uns sehr sehr wohl gefühlt. Die Gastgeber haben uns sehr herzlich empfangen und es lief alles ohne Probleme. Ich kann es nur weiterempfehlen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Nadine','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(971,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Positiv: Tolles Einrichtung Super Lage & Aussicht Ruhig Sehr sauber Negativ: Deckenhöhe/ Türrahmen für große Menschen schwierig Details fehlten wie Pfeffer, Seife. Sehr wenig Küchen Utensilien',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sören','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(972,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war alles zu unserer Zufriedenheit. Ruhige und schöne Lage mit direktem Blick vom Balkon auf die Skisprungschanze und aus den Fenstern in Richtung Zugspitze. Kommunikation, Schlüsselübergabe, usw. haben wunderbar funktioniert. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Christian','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(973,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nachdem wir die Check In Zeit um ca. 20min nicht geschafft hätten, wurden wir darauf hingewiesen, daß nach 20Uhr keine Anreise (laut Richtlinien) mehr möglich ist, welches mir Telefonisch vom Verwalter bestätigt wurde!! Deswegen gab es keinen Aufenthalt in der Ferienwohnung!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sigmund','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),(974,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Aufenthalt in der “Kleinen Auszeit” war perfekt. Kontakt, Schlüsselübergabe, alles perfekt! Die Wohnung ist absolut gemütlich, wir haben uns sofort wie zu Hause gefühlt. Die Lage ist top, toller Blick vom Balkon auf die Berge und die Sprungschanze. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/31289582/reviews','April 2019'),(975,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse kleine Wohnung zum Wohfühlen !',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Matthias','https://www.airbnb.de/rooms/31289582/reviews','März 2019'),(976,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Pro:\n- sehr saubere und gepflegte Wohnung/ Ausstattung\n- schöne Lage, gute Erreichbarkeit\n- super Blick vom Balkon\n\nContra:\n- Launische, unberechenbare Kommunikation\n- Folgende Situation fand ich mehr als unangebracht: ich war als offensichtlich Schwangere auf dem Weg aus der hier gemieteten Wohnung und sage auch noch, dass wir etwas durcheinander sind und auf dem Weg zum Arzt (ich bin zuvor gestürzt und gehe in meinem Urlaub nicht zum Spaß zum Arzt). Anstatt das Sie besorgt/hilfsbereit waren, haben Sie in einem sehr unfreundlichen Ton gesagt, dass das nicht Ihr Problem sei und keine Entschuldigung dafür, dass wir die Balkontür offen gelassen haben (Heizkosten). Wie kann man nur so wenig Verständnis/Mitgefühl haben, vor allem wenn wir uns dafür schon direkt entschuldigt haben und dir Tür sofort schlossen?\n\nZudem hielten Sie uns vor, dass wir die Vorhänge an den Fenstern geöffnet haben (diese konnte man innerhalb von 3 Sekunden wieder schließen, also keine komplizierte Konstruktion). Dies schien auch auf Nachfragen ein Grund zur cholerischen Aufregung zu sein. Sind Vorhänge nicht dazu da, geöffnet zu werden?\n\n!!!Ich wünsche Ihnen alles Gute und hoffe, dass Sie NIE auf solche Menschen wie sich selbst treffen, wenn Sie in einer Notlage sind!!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Jenny','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(977,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist mit Liebe zum Detail und sehr zweckmäßig eingerichtet und bietet alles, was man für eine kleine Auszeit benötigt. Geschäfte, Restaurants und Ausflugziele befinden sich in unmittelbarer Nähe. Gerne wieder.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Martina','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(978,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Gastgeber! Tolle Wohnung, perfekt fürs Wandern oder Skifahren!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Dennis','https://www.airbnb.de/rooms/31289582/reviews','Januar 2019'),(979,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Place is nice host is not',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Ellen','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(980,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderful host, would definitely recommend.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Tyler','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(981,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place, outstanding views and very clean',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Michael','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(982,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Marks place was a great base for our short stay in GP. The apartment was sparkling clean and had all that we needed for our stay. The only minor point for us was that the bath only had a handheld shower attachment, and we didn\'t realise this from the listing, however, this is our personal preference only and we appreciated it was probably due to the low ceiling heights. The apartment is located in a quiet residential area, with a 10/15-minute walk into the centre of GP, with free parking on the street outside which was a bonus for us.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Caroline','https://www.airbnb.de/rooms/31289582/reviews','September 2019'),(983,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Bel appartement , proprete irréprochable a 600 m des commerces de Partenkirchen .',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'François','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(984,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely stay in Mark\'s place. It was sparkling clean, it had everthing that we needed and the bed was very comfortable. The view is absolutely amazing. Communication from him was quick and we were met by both him and his wife upon arrival. He also gave us some great local tips. We will definitely be back in future and can higly recommend his place.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Carlien','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(985,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark’s place was in a great location. We were able to leave from the front door and go for hikes. The views from the balcony and windows were incredible. The kitchen was very small which was okay but it lacked a few items that would’ve been very helpful (there were no plates at all and only very big and very small bowls). The ceilings and doorways in the place are also very low which is hard to tell from the pictures. We had to crouch through some doorways and in the shower. Mark was prompt and professional with check in and check out. Overall, Mark’s place was a good fit for our time in GP!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Murray','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(986,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark has a great apartment. The town is lovely and the walk to the center and the train station and bus stops is not bad at all. About 10-15 minutes along the river! The best thing about the accommodation is the lovely view of the mountains from the balcony.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Gareth','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(987,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A comfortable flat in a quiet area. All facilities although the kitchen is fairly basic. Lovely views of the mountains from the balcony. Mark is a brisk and efficient host. If you don\'t have a car it is a pleasant 15 mins walk to the station and a further 10 to Garmisch town centre. Flat is ideally placed for Partnach gorge (20 mins away.) No wifi in the flat. All in all a very pleasant stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'A','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(988,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment has great views of the mountains and the ski jump. Handy to bus service or a 10-15 minute walk to town. The kitchen is quite basic with 2 burners and a kettle. No microwave or toaster. Only 2xsaucepans and 1 small fry pan. We cooked a couple of very basic meals. It is probably not an issue if you eat out each night. We enjoyed our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Noela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(989,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great location for hiking the Zugspitze, lovely apartment!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Cybele','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(990,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a nice stay. The apartment was great and had a very nice view. Was also very cozy and had everything we needed.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Soha','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(991,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My wife and I thoroughly enjoyed our stay at Mark’s apartment in Garmisch. We found it to be clean, quiet, and comfortable. It is located on a side street, with adequate parking and a pleasant walking path nearby. Garmisch is a beautiful town, and we enjoyed wandering around the downtown area visiting cafés, shops, and bäckereis. We also enjoyed looking at the beautiful scenery. This is definitely on our list of “visit again” places.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'William','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),(992,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice and clean apartment with easy access to the downtown. The accommodation provided us everything we needed. We enjoyed also bus passes that host provided. I recommend to be on time on check-in, otherwise you will get a \"nice\" welcome. I was late 13 min and the host was little bit unpleasant.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Ľubica','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(993,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark’s apartment is lovely and very well located halfway between Garmisch and the Olympic Ski jump. It is an excellent start point if you would like to explore Partnachklamm, which I would heartily recommend. It is about a 20 minute walk from the train station. The apartment was very clean and comfy and we loved our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'James','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(1071,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war einfach super! Man hat dort eine wunderschöne Aussicht! Die Gegend ist wunderschön und man kommt zu allem schnell hin! Die Kommunikation und die Abwicklung waren freundlich, schnell und reibungslos! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anuschka','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1072,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Wohnung und super Lage! Wir haben uns sehr wohl gefühlt.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Christopher','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1073,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, tolle Lage, tolle Vermieter!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Andre','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1074,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, die ihren Teil zu unserem entspannten Urlaub beigetragen hat. Wir hatten die ersten beiden Tage ein bisschen Pech mit dem Wetter, was aber aufgrund der schönen Wohnung mit dem wunderschönen Alpenpanorama nicht weiter schlimm war. Die online gestellten Fotos bilden die Wohnung authentisch ab. Peter war als Gastgeber zwar nicht vor Ort, hat aber umgehend auf Mails und Anfragen reagiert und war jederzeit offen, superfreundlich und hilfsbereit. In dem Haus selbst wohnt zudem eine weitere Kontaktperson, die bestimmt auch jederzeit geholfen hätte, wenn wir was benötigt hätten. Die städtische Baustelle vor dem Haus, die sich dort gerade befindet, war auch nicht wirklich störend. Von daher bleibt mir nur zu sagen: Wer im Gebiet Garmisch-Partenkirchen seinen Urlaub verbringen möchte, dem kann ich Peter und seine Wohnung nur wärmstens empfehlen. Danke!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jung-Hun','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1075,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft und Ort, herrliches Panorama vom Balkon aus. Zugspitze, Eibsee und Höllental sind in unmittelbarer Nähe erreichbar! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jascha','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),(1076,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Geräumige Wohnung mit schönen Bädern und tollem Ausblick in die Berge. Alles vorhanden was man braucht. Der Check-in und Check-ourt mit der Schlüsselbox hat super geklappt. Der Holzboden knarzt, was nachts vor allem die Personen stören kann, die im oberen Bereich schlafen. Die Gästekarten waren leider nicht vorbereitet, wir hätten sie aber in der Touristen-Info ausdrucken lassen können. Die Kommunikation mit Peter hat gut und schnell funktioniert.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kerstin','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),(1077,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne Unterkunft in Obergrainau. Unkomplizierte, nette Vermietung.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lukas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1078,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wirklich super schön und für größere Gruppen geeignet (allerdings sollte man sich bewusst sein, dass einige Schlafplätze offen sind, steht aber auch so in der Beschreibung). Die Bäder waren beide sehr schön und sauber. Auch sonst war alles sauber außer einige Teller. Schöne Aussicht von den Balkonen. Die Bauarbeiten haben uns nicht gestört, nur die nahestehende Kirche hat uns schon früh geweckt. Wir würden wieder kommen!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jana','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1079,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das großzügige Raumgefühl und der Balkon als Logenplatz, um den Dorfplatz zu beobachten, haben uns besonders gefallen. Die Angaben und Fotos entsprechen der Wohnung, so wie wir sie vorgefunden haben. Schöne Randlage im Oberdorf in einer quirligen und stark besuchten Ferienregion. Sehr empfehlenswert!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Petra','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1080,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war sooo schön! Peter & Annika waren tolle Gastgeber! Die Kommunikation lief einwandfrei und sie waren sehr entgegen kommend. Die Wohnung sieht in echt noch viel schöner aus, sie war blitzsauber und es war einfach herrlich mit diesen Ausblick in den Tag zu starten. Wirklich sehr zu empfehlen! Vielen Dank nochmal & bis hoffentlich bald mal wieder :)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Gabi','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1081,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse Unterkunft. Es war, wie es beschrieben wurde; nichts geschönt oder ausgelassen. Einfach eine tolle Wohnung zum Wohlfühlen. Die Lage ist klasse, mit Blick auf die Bergwelt, kurze fußläufige Wege zum Bäcker (übrigens ein echter Super-Bäcker), zu Restaurants, Metzger, kleiner Supermarkt und zur Bahnstation der Zugspitzbahn. In alle Richtungen ist man sofort auf den gut ausgeschilderten Wanderwegen. Und wenn man doch mal mit dem Auto fährt, ist am Haus immer ein Parkplatz. Die Wohnung selbst ist voll ausgestattet, Geschirr und Besteck ist mehr als ausreichend und aus einem Wurf (keine gesammelten Generationen-Nachlässe), gemütliche Betten und Sofas. Im Vorfeld war die Kommunikation zu Peter schon schnell, sauber, präzise, und das hat sich fortgesetzt. Für die wenigen offenen Fragen, die vor Ort waren, kam immer prompt und klar eine Antwort und Hilfe. Kurzum: das war nicht unser letztes Mal dort :-)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1082,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war super geräumig für uns vier, zwei Erwachsene und 2 Kinder. Ausstattung war super. Betten waren auch gut, der Blick herausragend. Die Dielen knarzen wirklich ordentlich, es sollte kein Frühaufsteher in der Gruppe sein, sonst sind alle wach ;-) wir kommen wieder. Uns hat es sehr gut gefallen, trotz Dauerregen. Tipp: mit der Kurkarte kostenlos ins Wellenbad in Garmisch.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Bianca','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1083,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft liegt sehr zentral. Eine Bushaltestelle ist in der Nähe, somit viele Ziele ohne Auto erreichbar. Mehrere Wandertouren starten in unmittelbaren Nähe. Es ist sehr gepflegte, saubere Unterkunft. Alles was man braucht ist vorhanden. Das Check-in unkompliziert und schnell. Auf jeden Fall zu empfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ludmilla','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1084,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Immer wieder gerne.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Willi','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1085,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten mit der Familie eine tolle Zeit in Grainau. Peter war jederzeit erreichbar und sehr hilfsbereit. Mit kleinen Kindern muss man mit der Galerie acht geben. Wir haben wie viele andere Gäste, die Couch vor die Treppe geschoben, damit dem Laufanfänger nix passiert. Gerne wieder.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Julia','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1086,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft von Peter ist gut gelegen, mit einem tollen Bergpanorama. Der Fußweg zur Zugspitzbahn ist kurz und gute Restaurants sind in der Nähe. Wir haben gut geschlafen und hatten mit 6 Erwachsenen und zwei Kleinkindern ausreichend Platz. Wir kommen gern wieder.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sebastian','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1087,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ein wundervoller Aufenthalt, der gerne noch länger hätte sein können! Die Galerie-Wohnung war super sauber, ordentlich & einfach ein Traum! Alles wie online beschrieben. Der Besitzer hat mir vorab eine nette Nachricht geschrieben, in der vieles beschrieben war. Über eine Schlüsselbox konnten wir unkompliziert einchecken. Von der Unterkunft aus konnten wir direkt zur Höllentalklamm wandern. Die Lage ist einwandfrei. Wir kommen gerne wieder. Vielen lieben Dank! Liebe Grüße aus Nürnberg',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Laura','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1088,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ganz freundliche und stets erreichbare Vermieter, die eine tolle Wohnung in atemberaubender Lage anbieten! Nicht zu toppen! Wir kommen gerne wieder',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anne','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1089,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten einen sehr schönen Aufenthalt in Grainau. Die Wohnung hatte eine perfekte Lage, der Eibsee, Wander- und Radwege waren in unmittelbarer Nähe, Einkaufsmöglichkeiten wie Bäcker und Lebensmittel ebenso. Die Wohnung ist geräumig und wir haben uns sehr wohl gefühlt und würden sie daher jederzeit weiterempfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Philipp','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1090,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super idyllisch gelegene Wohnung mit überaus freundlichem Gastgeber. Die Aussicht vom Balkon ist ein Traum, Wandern ist direkt ab der Wohnung möglich und vom Dachfenster aus kann man glückliche Kühe auf grünen Bergwiesen beobachten, Entschleunigung pur, danke Peter',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Marina','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1091,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Alles top! Empfehlenswert!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ruben','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1092,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wunderschöne, großzügige Unterkunft, urig und gemütlich. In der Küche war alles vorhanden, Handtücher, Seife etc. alles da. Kaminofen mit reichlich Feuerholz für kuschelige Abende. Matratzen perfekt. Alles war supersauber. Haben uns selten so wohl gefühlt wie hier und bedanken uns herzlich!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Olivia','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1093,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','tolle Wohnung in Superlage (näher an den Bergen geht es nicht) ! alles bestens',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Heinrich','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1094,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren zu acht in Peters Wohnung. Darunter zwei Kinder (13 und 18 Monate), die in der Wohnung gut zurecht kamen. Es waren ein Kinderbett und ein Kinderstuhl bereits vorhanden. Die Wohnung würden wir \"kindersicher\" beschreiben, wenn man das Sofa vor die Treppe stellt. Der Ort bot für Spaziergänge gute Ausgangsmöglichkeiten und die Skigebiete drumherum sind für Familien perfekt. Auch die Kommunikation mit Peter hat hervorragend funktioniert, und vor Ort war auch noch jemand, den man notfalls um Hilfe bitten konnte. Ich kann diese Unterkunft nur wärmstens empfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sebastian','https://www.airbnb.de/rooms/19774742/reviews','Februar 2020'),(1095,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft blieb nicht hinter den Erwartungen zurück. Übergaberegellungen erfolgten unkompliziert über das Airbnb-Portal / (Hidden by Airbnb) . Telefonkontakt war nicht erforderlich. Die Wohnung ist sehr schön. Kaffeevollautomat und Kaminofen funktionierten ohne Probleme. TV- und Audiounterstützung entspricht nicht dem übrigen Standard.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Reinhard','https://www.airbnb.de/rooms/19774742/reviews','Januar 2020'),(1096,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das Apartment war sehr gut, die Kommunikationwar super und es ist sehr empfehlenswert.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Felix','ht