tal gastfreundlich!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Johanna','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1542,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage, sehr schön besonders eingerichtete Wohnung und ganz liebe und aufmerksame Gastgeber! Gern wieder!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Patricia','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1543,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr nette Gastgeber. Supermärkte auf der anderen Straßenseite. Garmisch ist mit dem Auto schnell erreicht',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Sergej','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1544,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Wohnung mit schönen Art deco Details . Genug Platz für Familie mit 2 Kindern. Hervorragende Lage und zuvorkommende Gastgeber .',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Rahel','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2019'),(1545,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren zu 4 in der Wohnung - 2 Erwachsene und 2 Kinder (13 und 6 J.a.). Die Wohnung befindet sich in Dita\'s Haus - ist aber komplett abschließbar und gibt sehr viel Privatsphäre. Man hat eigene kleine Küche und Bad. Die Wohnung und das Haus insgesamt sehen noch viel besser als auf den Bildern aus - alles ist ziemlich frisch renoviert. Sowohl die Schlafsofa als auch Bett waren sehr bequem. Der Ortskern befindet sich 5 min Fußweg von dem Haus, Wanderwege sind auch zu Fuß zu erreichen. Das Region hat sehr viel anzubieten, besonders für Familien mit Kindern als auch für Nature Lovers. Dita antwortet sehr schnell, gibt\'s zahlreiche Tipps und ist sehr freundlich. Ich würde die Wohnung jederzeit noch mal buchen.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Gosia','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1546,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schön',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Alexander','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1547,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','1000 Dank Dita für die Herzliche Gastfreundschaft und super Lage, 1A',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Samir','https://www.airbnb.de/rooms/22523800/reviews','Juni 2019'),(1548,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung (wie auch die Lage) ist super und wirklich nett eingerichtet. Dita war sehr unkompliziert und die ganze Familie sehr sympatisch. Wir haben uns bei ihr wohlgefühlt und können uns nur bedanken und die Unterkunft weiterempfehlen!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Isadora','https://www.airbnb.de/rooms/22523800/reviews','März 2019'),(1549,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gerne wieder!!!:)',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Tetyana','https://www.airbnb.de/rooms/22523800/reviews','Februar 2019'),(1550,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','eine bezaubernde Unterkunft mit Sher freundlichen Gastgebern. sehr für Familien mit Kindern zu empfehlen.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Susan','https://www.airbnb.de/rooms/22523800/reviews','Dezember 2018'),(1551,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Diese Villa können wir uneingeschränkt weiterempfehlen. Es war viel besser als erwartet. Die einzelnen Zimmer wurden sehr geschmackvoll und mit Liebe zum Detail eingerichtet. Es wurde dabei wirklich an alles gedacht. Der Standpunkt ist ebenso perfekt! Gerne wieder.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Justyna','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),(1552,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Alles TipTop! Trotz sehr spontaner Buchung hat alles reibungslos geklappt! Der Gastgeber war sehr gut erreichbar und kam und bei den Check-In Zeiten entgegen. Gerne wieder:)',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Robert','https://www.airbnb.de/rooms/22523800/reviews','August 2018'),(1553,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne Unterkunft.. Urige alte Villa geschmackvoll und schön renoviert.. Verspielt und stilvoll.. Gastgeber samt Kinder und Hund ausgesprochen freundlich.. Zum rundum wohlfühlen.. Sehr zum empfehlen',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Petra','https://www.airbnb.de/rooms/22523800/reviews','April 2018'),(1554,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Ausgangspunkt um die Gegend rund um Oberammergau zu erkunden. Das Haus ist stilgerecht renoviert worden und hat einen tollen Charme. Wir haben uns dort sehr wohl gefühlt auch dank der Gastfreundschaft von Dita und ihrer Familie. Leider hatten wir nur 2 Tage Zeit. Wir werden sicher wiederkommen. Sehr zu empfehlen.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Stephan','https://www.airbnb.de/rooms/22523800/reviews','März 2018'),(1555,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr angenehme Wohnung, schone, sobere und praktische. Dita war sehr nett mit uns 5. Stadt Oberammergau 5min zu fuss und viele Wanderung in der Nahe :-)). Danke Dita !',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Clémence','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1556,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super schönes Haus bei einer sehr nette Famille. Die Wohnung unter dem Dach ist wirklich toll für eine Familie. Stadtmitte ist in 5 Minuten zu Fuss zu erreichen. Dita ist eine wunderbare Gastbeberin!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Gerald','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1557,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','ICH KANN NICHTS ANDERES ALS LOB SCHREIBEN!Wir hatten sehr schönen Urlaub! Unterkunft war sauber und gemütlich.Die Gastgeberin war sehr freundlich und hat uns viele Vorschläge gegeben,wo man hin fahren kann..Die ganze Familie wahr sehr lieb und wir haben uns sehr wohl gefühlt!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Jana','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1558,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect! Unique design with lovely details. You can see how the hosts care about everything. The house itself is very old and beautiful. Everything works well enough. You can also enjoy lovely garden with swings and trampoline. Wonderful view to the mountains. Train station, supermarket are right across the street. City center and Alpine coaster are about 10 minutes. Dita and her family are so nice and welcoming! I can only recommend this apartment.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Tatiana','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1559,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dita and her family are amazing hosts, who really go above and beyond to make your stay very enjoyable! With a fast response, great tips and good conversations we had a great time! The space is super clean and very homey!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Jutta','https://www.airbnb.de/rooms/22523800/reviews','September 2019'),(1560,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Last minute booking and Dita was very accommodating. The apartment is well stocked and we slept 4 comfortably (fit in couch folds down the size of about a king size bed). I would stay here again. Great little town and close to Garmish for skiing. Only complaints: The shower head is awesome, unfortunately at 6\'4\" it came to just below my shoulder. But great water pressure and plenty of hot water. The parking was across the street in the grocery store parking lot. Both issues were minor and should not deter most people from staying here.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Joe And Cristin','https://www.airbnb.de/rooms/22523800/reviews','Januar 2019'),(1561,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dita’s place was so nice. Lots of vintage art that made my star even more interesting. I love how chic yet efficient her place is. Walking distance to the alpine coaster and city center. And, it’s a perfect starting point for runners or cyclist. I totally recommend her place.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Nia','https://www.airbnb.de/rooms/22523800/reviews','September 2018'),(1562,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great Location, wonderful hosts, and clean rooms! Dita was quick to respond to my messages, recommended an amazing local restaurant, and her dog is so sweet! Highly recommend her BnB!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Danielle','https://www.airbnb.de/rooms/22523800/reviews','Juni 2018'),(1563,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Abbiamo soggiornato 4 giorni presso l appartamento di Dita. L appartamento è in mansarda e la propreitaria vive nell appartamento al piano si sotto. Siamo stati trattati con cortesia dalla priprietaria. La posizione è ottima per qualsiasi escursione. Ampio parcheggio sempre libero proprio di fronte alla casa e sempre di fronte alla casa ci sono diversi supermarket. Mi sento di consigliarlo',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Monaldo','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1564,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Séjour très agréable chez Dita. Belle maison et très joli appartement décoré (Art Nouveau) avec beaucoup de goût, il y a tout ce qu\'il faut, très propre. Bonne communication avec Dita pour notre arrivée. Bon emplacement. Beaucoup de choses à faire dans la région. Nous recommandons absolument.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Benoit Et Lucie','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1565,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sweet apartment and outstanding location. Had a good time. The apartment is in the attic so low ceilings on the corners caused a few bumped heads. But the bed and couble sofa bed are very comfortable for 4 adults.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Chitra Mohan','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1566,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Comfortable and clean, near the center of the town, several supermarkets just across the road.Very nice and caring host Dita',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Maxim','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1567,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a wonderful place for travelers to stay during a trip to lovely Oberammergau. Dita is extremely courteous and helpful, offering us suggestions for hikes and other fun things to do while in town (try the Alpine Coaster!). The space itself is especially charming and clean—we felt comfortable there at once. There is one bedroom with (I think) a Queen size bed, and a pull out sofa bed that’s about the same size in the main room that also houses a sink, small stovetop, and fridge. The bathroom and shower room are very clean, and towels were provided. The shower is a bit low in height (I’m 6’1 and had to crouch a bit to fit under the shower head) but this is honestly a minor inconvenience unless you are especially tall (I think anyone 5’8 or under can fit in it without issue). The location is prime—a 1min wall from the bus stop, several grocery stores and shops are right across the street, perhaps 5 or so min from the town center with restaurants and shops, and walkable to many trailheads. Truly I can not recommend this lodging (and Oberammergau) enough!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Harrison','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1568,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Très commodément placée entre Garmisch-Partenkirchen d\'un côté et le château de Neuschwanstein de l\'autre, à proximité du palais de Linderhof, la très belle maison de Dita offre de beaux espaces au deuxième étage. L\'équipement est suffisant et la décoration est sublime.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Philippe-Aurèle','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1569,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It’s not too large but very nice apartment in a one of the most beautiful old stylish villas in the town. Decorated with a great taste with art nouveau details and in whole dedicated to Mucha. It is a very calm surroundings so we slept very good. Liddl is just in front of the house, and all the historical famous buildings are just in five minutes. The town itself is very small so almost everything would be a centre)) but a special advantage was an rail alpine coaster that starts almost just behind the house (again, thank you, Dita, for the great advice!). Also it’s just 1 hour walking from the beautiful cloister of Ettal that definitely in the “must see” list. Dita is a wonderful host, hostile and attentive. Highly recommended!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Olga','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1570,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A wonderful stay! Dita is very responsive and her place is very nice!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Dale','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1571,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Really nice flat! Dita was a really nice host and gave uss good tips what to do!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Satu','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1572,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a great place at a perfect location with a friendly host. Defenitely recommend it to anyone!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Katrin','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1573,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place in a beautiful town. Lovely hosts...',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Chad','https://www.airbnb.de/rooms/22523800/reviews','Juni 2019'),(1574,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stylish apartment in an early 20th century villa.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Karlis','https://www.airbnb.de/rooms/22523800/reviews','April 2019'),(1575,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was a pleasure to stay here, convenient, many shops nearby, very close to the city centre, extremally clean, overall high quality, in reality it looks better than on a pictures.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Aleksy','https://www.airbnb.de/rooms/22523800/reviews','Januar 2019'),(1576,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great space in an historic house in Oberammergau. Dita was very helpful with suggestions, and even Christmas decorations (we were there for Christmas).',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Jim','https://www.airbnb.de/rooms/22523800/reviews','Dezember 2018'),(1577,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ottima accoglienza, ottima anche la location.. Grazie',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Ledjon','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),(1578,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was the best Airbnb I’ve stayed in. The apartment was even nicer than pictures and had a cozy feel. What really sold it was Dita’s hospitality. She lives on site and seeing we had two young daughters she had her children share some toys and books in English, which our girls loved playing with and reading. Dita gave us great tips on what to see and do and simply couldn’t have been a better host. The location was also fantastic. Across the street from grocery stores, one with a great cafe and excellent bread, and walking distance to everything in town. There is a great path along the river, which looked nice for a bike ride. The highlight was the alpine slide, which is the longest in Europe, and is basically right behind her house. We had a car and found her house to be a great jumping off point for many area highlights, including 3 of Ludwig’s castles Do not hesitate to book here!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Nick','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),(1579,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A very lovely family! Great tips on the town, great outdoor adventures to be had! Perfect central location, would definitely stay there again',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Tracye','https://www.airbnb.de/rooms/22523800/reviews','August 2018'),(1580,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','At Dita’s house is every little thing beautiful and stylish. Very clean and comfortable. The location is super, beautiful views around. Opposite the house are supermarkets, nice walk to the center takes about 10 min.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Andres','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1581,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','dita was such a great hidt hrlping us with any questions we have. the olace was extremely lovely as well',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Ryan','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1582,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a wonderful stay in Oberammergau and the it is the perfect location for everything you want to do in the surroundings. We got many good advice for hiking, although we had it all planned in advance, were greeted very friendly and if i ever come back I would never hesitate to check out the availability of Ditas place again!! Feel free to be amazed :)',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Sofie','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1583,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Comfortable apartment in the attic, clean and functional, nice housemaid Dita. Markets near but peacefull. beds maybe a little too hard but sometimes it`s good.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Satu','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1584,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The 3 of us stayed 2 nights at Dita\'s home. The rooms were very clean and well equipped. The shops are just across the house. Dita was helpful and gave us some tips what to see, to do, where to eat, etc. She was a friendly host and we had a great time there.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Ivett','https://www.airbnb.de/rooms/22523800/reviews','Juni 2018'),(1585,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The Dita\'s house is really great, the place is very nice, confortable and large. It has all the facilites for a good stay. The house is really near to the supermarket, the bus station, restaurants. Dita is a very kind person and she helps you in what you need. In general, my stay in this place was wonderful.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Mudvayne','https://www.airbnb.de/rooms/22523800/reviews','Mai 2018'),(1586,0,28,'00001','6