.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tim','https://www.airbnb.com/rooms/21379053/reviews','February 2021'),(1714,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Just WOW! Exceeding expectations on every level! Absolutely beautiful accommodations with every detail and comfort well thought plus delighted with the welcome friendliness and easy communication with a great host. The stay was so great that a second booking for the next weekend was made before departure. Thank you CB!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Rebekah','https://www.airbnb.com/rooms/21379053/reviews','February 2021'),(1715,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My preteens and I had a good time at CB\'s place. Trail was a couple of steps away and good for snowmobiling, xc skiing, and walking. Kitchen was well stocked, and the beds were comfortable.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Sarah','https://www.airbnb.com/rooms/21379053/reviews','February 2021'),(1716,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sparkling clean and dreamy spot. We hope to come again sometime.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Sadie','https://www.airbnb.com/rooms/21379053/reviews','February 2021'),(1717,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Outstanding place to stay. Spotless clean and very welcoming. Would definitely stay again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Patrick','https://www.airbnb.com/rooms/21379053/reviews','October 2020'),(1718,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place, great location (right on the river). Cb\'s place is spacious with high ceilings, immaculately clean, modern, and equipped with all the amenities you need. I hiked along the river, and at night I took a flashlight and watched two otters swimming and fishing. The river with its adjacent is beautiful - out of a movie. I set my folding chair alongside and ate lunch while I stared at the fall foliage and listened to the crows and moving water. Check in was as easy as it gets.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Paul','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1719,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Cb\'s place was nice.right off the main 4 wheeler trail and nice and quiet. Would stay again',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jordan','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1720,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a beautiful property with excellent hospitality. Serene and relaxing. If you are looking to relax and just enjoy the beauty of country and nature, this is your place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tracy','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1721,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sparkling clean, great hosts, and a beautiful apartment. We can\'t wait to come back!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Amy','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1722,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you are looking for a place to experience Northern Maine\'s summer beauty or the Northern Wood\'s winter wonderland, Cb hosts a perfect place to stay. At the end of a winding private drive, the apartment has it\'s own entrance and it was immaculate when we arrived. Cb, was gracious enough to work with us on our arrival time and was very welcoming. While there are other rentals(camps) on the property, each is set away from the others and each is private and quiet. The back drop to the location is the picturesque Aroostook River, with one of the main ATV/sled trails that follows the banks of the river able to be accessed from the property. The wilderness is just a few steps down from the camps. One morning we awoke to the sound of a hunting eagle over the river. The interior of the apartment showcases custom wood work, private bed rooms (one in a perfect loft), and an open theme that allows you to move you travel gear in easily. The bathroom is spacious with amenities on the shelves such as towels, wash clothes & mats. The kitchen area is perfect for preparing anything you could want to make yourself and is well stocked with plates, bowls and cooking ware. Alternatively, the apartment is also only 10 to 15 minutes from the \"major\" towns in the area should you want to eat out. The wifi allowed all three of us to connect multiple devices with no issues and we did not experience any type of latency. I will be recommending Cb\'s places to anyone looking to stay in Northern Maine. We had an excellent time there and it was perfect for our annual guys weekend!! Thanks Cb!\nShow more',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Noah','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1723,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely trip to quaint Caribou, Maine. The apartment was spacious and open and we had a private entrance which made it feel like our own. The views of the river and the peace of the area were lovely. Would book again!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jessica','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1724,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Spacious place with astounding woodwork. The location is wonderful if you want a true rural existence. The river trail was just down the slope and provided amazing wildlife sightings for the patient and persistent - moose, deer, beaver and more eagles than you can shake a stick at! Dark skies as well in case you feel like stargazing. This is the closest I have felt to living in the wild in a long time. Amazing.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'James','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1725,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place. Very clean. Out of the way but not too far from stores/shops. Woukd stay here again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Karen','https://www.airbnb.com/rooms/21379053/reviews','July 2020'),(1726,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My stay was warm, welcome, and I could not ask for a better host. This particular cabin has such a serene setting on the river. I enjoyed my stay and look forward to coming back.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Anthony','https://www.airbnb.com/rooms/21379053/reviews','June 2020'),(1727,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I booked this for my son and his friends to go snowmobiling. It was a great, clean place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tonya','https://www.airbnb.com/rooms/21379053/reviews','March 2020'),(1728,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The accommodations were great!! Very cozy and welcoming when we arrived!! Trail access was very easy from the location!! CB is so friendly and helpful!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Linda','https://www.airbnb.com/rooms/21379053/reviews','March 2020'),(1729,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful space and wonderful hosts!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Sonia','https://www.airbnb.com/rooms/21379053/reviews','March 2020'),(1730,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place was very nice, We checked in on the same day CB was quick to respond and made everything very easy.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Nick','https://www.airbnb.com/rooms/21379053/reviews','March 2020'),(1731,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very clean and charming. Beautiful on the inside. Secluded and serene',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Makenzie','https://www.airbnb.com/rooms/21379053/reviews','February 2020'),(1732,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The the place was great and felt like home for our 10 day stay. Cb was very helpful when we had some snowmobile issues',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Steven','https://www.airbnb.com/rooms/21379053/reviews','February 2020'),(1733,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was our first ever AirBNB experience and it was outstanding! The space was extremely comfortable and clean, and in a great location for what we needed. CB was so helpful and great to chat with! We cannot wait to go back!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Holly','https://www.airbnb.com/rooms/21379053/reviews','January 2020'),(1734,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','CB was awesome and the place was a country boys dream beautiful views and nice atmosphere',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Chris','https://www.airbnb.com/rooms/21379053/reviews','December 2019'),(1735,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a great location for splitting my time between Caribou and Presque Isle. The space was lovely and stayed cozy even with the cold outside temps during my stay. The hosts were warm and welcoming, and I would stay here on a future trip.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Heather','https://www.airbnb.com/rooms/21379053/reviews','December 2019'),(1736,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Cb’s place is roomy yet cozy at the same time. Wonderful location with a gorgeous river walk right out back.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Sara','https://www.airbnb.com/rooms/21379053/reviews','November 2019'),(1737,0,1,'00001','66bb