at for work or relaxing.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Heather','https://www.airbnb.com/rooms/21379053/reviews','September 2018'),(1756,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Outstanding hosts , Outstanding place. I highly recommend staying with Cb.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tim','https://www.airbnb.com/rooms/21379053/reviews','September 2018'),(1757,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful barn-turned modern apartment with every amenity you could think of. Scenic location situated right next to the Aroostook River which is literally a few paces away. I wish I could have stayed longer. Received excellent hospitality from the hosts Vicki and CB. Hospitality that only occurs in ‘the county.’ Place was immaculately clean. Pictures don’t do the place justice. You have to experience it for yourselves. I visit my friends in Limestone very frequently and will be back for another stay soon.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'David','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1758,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Our stay was eagerly anticipated because we had been for a short visit with previous guests. Our stay exceeded every expectation. CB and Vicki were so gracious and accommodating. The beauty and serenity of the location made the stay perfect. Already trying to plan when we can visit again. I will be recommending highly to anyone traveling to the area.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tracy','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1759,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful space with the most amazing hosts! I would suggest this place to anyone♥️',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Debbie','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1760,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great time hanging out around the bonfire! Beautiful area..enjoyed the trails along the river. Will be back!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Meghan','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1761,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great little spot with beautiful scenery all around! Host CB is very thoughtful and displays great attention to the little details! Thank you! Maggie',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Maggie','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1762,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','amazing host, great location, fantastic spot all around',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Rob','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1763,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Newly built space in a beautiful setting. The guest space is in the big red barn next to the host’s house. Vaulted ceiling and beautiful bartop and counter made from one tree. Having a washer and dryer was a nice plus. There’s no air-conditioning but we got a fan from the host and put it in the window.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jason','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1764,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a beautiful home, the pictures do not do it justice. The interior is thoughtfully designed, and really spacious. The beds are comfortable and each room was sparkling clean. The first floor is wheelchair accessible with the master bedroom on the first floor, while the second bedroom is upstairs. Close enough to town to get groceries, and wine, or see a movie. Far enough, to feel like you are secluded in the quiet of the county. My friends and I had a wonderful time walking around the grounds, enjoying the nature that is right in the backyard. The river is gorgeous in the early morning, highly suggest taking a stroll and enjoying the outdoors here.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Kathleen','https://www.airbnb.com/rooms/21379053/reviews','August 2018'),(1765,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I rented both the cabin and apartment here for a family trip to Caribou. This place was awesome, as comfortable as being at home. If you love quiet and wildlife, this is the perfect place for you. I spent a good part of my time here, just sitting out by the river with my camera. CB is a perfect host, and the property is well kept up. You won\'t be disappointed. I look forward to going back again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Wolf','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1766,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','very private, great location, great place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Robert','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1767,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a perfect place to stay! The place is large and has all the comforts of home! The place was beyond clean and easy to find. There is a rail trail right off the property that is great to stretch your legs after a lot of driving and nice views! I will stay here again!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Lisa','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1768,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My wife and I stayed in the River House Apartment while in the County for a class reunion. It was a great choice. I had no idea I would be enjoying my morning coffee while walking along the river enjoying the solitude, sun, breeze and and the wildlife. The property really is a hidden piece of paradise right on the Aroostook River. The Apartment we stayed in was immaculate, peaceful, quiet and the decor made us feel right at home. The Apartment had full amenities, including a washer and dryer which was very convenient. And, most importantly, Cb, Vicki and David were excellent hosts. can\'t wait to return in the fall for another visit.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Michael','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1769,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','CB\'s spot is the perfect spot if you headed to Presque Isle, Caribou or Limestone. He has thoughtfully included all of the necessary amenities. The decor is nice, the beds were comfortable and everything worked perfectly. CB is quick to respond to questions. My family found it very convenient that he has a full-size washer and dryer and spacious open-floor plan kitchen and lots of open areas to store stuff. The apartment is sparkling clean and stocked with everything that you need including all necessary pots, pans, linens, extra pillows, etc. Given the limited number of accomodations, it was a great surprise to find CB\'s spot. I also recommend mountain-biking along the ATV/Sled (snowmobile) trail along the river immediately behind CB\'s spot. If you forget anything, it is about a 15 minute drive to Presque Isle where you can find a Lowe\'s, WalMart, high-end bike and ski shop and ICE CREAM!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Gregory','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1770,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The accommodations are spectacular- beautiful, clean and charming. We took long walks along the river, visited the lake and ate a lot of lobster rolls. Highly recommend this location and rental for a great get away',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Erika','https://www.airbnb.com/rooms/21379053/reviews','July 2018'),(1771,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','River House is an outstanding place to stay. I highly recommend the place for its great hosts, quiet and private setting and very nice accommodations. I truly look forward to my next stay.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tim','https://www.airbnb.com/rooms/21379053/reviews','June 2018'),(1772,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A great place to stay in the middle of nature. CB is a great host, too.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Katy','https://www.airbnb.com/rooms/21379053/reviews','June 2018'),(1773,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful apartment just the right distance from town and be sure to catch the sunset.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Deb','https://www.airbnb.com/rooms/21379053/reviews','June 2018'),(1774,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We loved our stay! It was quiet, quaint and clean. There is a great hiking trail behind the home along the river. CB gave us excellent suggestions on things to do in the area. We would definitely stay here again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jacki','https://www.airbnb.com/rooms/21379053/reviews','June 2018'),(1775,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','we had a whirlwind visit, but it all worked out perfectly. Cb was super flexible. looking forward to many more visits!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jody','https://www.airbnb.com/rooms/21379053/reviews','May 2018'),(1776,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What a gem! The units are new and absolutely gorgeous. Full cooking kitchen, wonderful open space areas. You can walk a few steps to the river where there is a riding trail. Had a nice conversation with the host at the beginning and then did not need to interact further, but he was always a phone call away. There are restaurants and shopping about five miles away, which is not bad for that part of Maine. If you need to stay anywhere near Caribou, Maine, I encourage you to try this place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Hal','https://www.airbnb.com/rooms/21379053/reviews','May 2018'),(1777,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Incredible host, Beautiful place, amazing secluded location. Look out the window and see a beautiful river. Peaceful. The place was awesome, the feel of rustic and upscale at the same time. The interior was incredibly detailed. Will def stay again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Michael','https://www.airbnb.com/rooms/21379053/reviews','May 2018'),(1778,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice place to stay, highly recommended for anyone in the area that’s looking for a place with great amenities and a very accommodating host.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Josh','https://www.airbnb.com/rooms/21379053/reviews','April 2018'),(1779,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This location worked perfectly for me. Less than 15 minutes to Presque or caribou. The hospitality from this couple was unbelievable. Could not ask for a better spot to stay. It’s clean, easy access, and it’s right beside the water. I would highly recommend to others, and I would stay here again without a doubt.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Matt','https://www.airbnb.com/rooms/21379053/reviews','April 2018'),(1780,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The pictures do not do this location justice, absolutely gorgeous. CB &Vicki are awesome hosts with wonderful hospitality. This place felt like home away from home. If you’re looking for a nice getaway this is the perfect place to stay! I look forward to coming back!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jackie','https://www.airbnb.com/rooms/21379053/reviews','November 2017