ouse is perfect. The living room is spacious, the bedroom has a comfortable queen bed and a brand new ar-conditioner. The house itself was full of detailed touches in the decoration. The tv room has a nice tv with a useful chrome cast. The internet connection also was really good, I’m a software engineer doing home office and while there I didn’t have any issue. Carolina and Traxon were always available and did provided more than necessary to make our stay perfect. I totally recommend, for the price, it can be the best hospitality you could find around. Also, Traxon and Carolina really care about the environment so they provided a lot of organic stuff to maintain the cleaning during the stay, I take this as a bonus because this products normally are a bit more expensive than the normal ones at the market. Also the place is peaceful and quiet.',5,NULL,0,0,'2021-06-03 05:36:20','2021-06-03 05:36:20',0,1,NULL,'Lucas','https://www.airbnb.com/rooms/48523518/reviews','May 2021'),(1832,0,5,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is amazing! We had a great time. It‘s quiet and at a great location! Also the host is very nice and helpful.',4.82,NULL,0,0,'2021-06-03 07:23:59','2021-06-03 07:23:59',0,1,NULL,'Sandra','https://www.airbnb.com/rooms/34200604/reviews','July 2020'),(1833,0,5,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Très bien placé pour avoir accès aux calanques',4.82,NULL,0,0,'2021-06-03 07:23:59','2021-06-03 07:23:59',0,1,NULL,'Martinez','https://www.airbnb.com/rooms/34200604/reviews','May 2021'),(1834,0,5,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Très bon logement, conforme au descriptif.',4.82,NULL,0,0,'2021-06-03 07:23:59','2021-06-03 07:23:59',0,1,NULL,'Sandrine','https://www.airbnb.com/rooms/34200604/reviews','May 2021'),(1835,0,5,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Bonjour, un week-end rapide ou nous avons profité de l’hébergement bien situé à proximité des randonnées dans les calanques....Christophe est disponible e