tion as home base to venture out for daily activities and then return for a quiet neighborhood to sleep. Five star stay!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Jordan','https://www.airbnb.de/rooms/34928560/reviews','Oktober 2019'),(1906,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','They got everything you need. PERFECT Truly recommended',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Teh','https://www.airbnb.de/rooms/34928560/reviews','Oktober 2019'),(1907,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We were every glad to stay here!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Yulia','https://www.airbnb.de/rooms/34928560/reviews','Oktober 2019'),(1908,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Adoramos o espaço como um todo, super confortável e muito bem mobiliado desde ferro, secador, máquina de lavar louça e roupa! Muito próximo à estação de metrô e um supermercado! Já estamos com vontade de retornar!! E sem contar que Caroline está disponível sempre em ajudar!! Muito obrigada',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Aline','https://www.airbnb.de/rooms/34928560/reviews','Oktober 2019'),(1909,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ótimo local, ótima pessoa e ótimas dicas. Fácil de se transportar e acesso a um número razoável de restaurantes, metrôs e supermercado.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Bruno','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1910,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Lovely little loft in a lovely suburb of Munich ! Bus stop is just a couple of minutes walk from the loft and will take you about 25 minutes to get to the city centre. Overall, for a short stay, my girlfriend and I had great time in Caroline and Tobias\'s loft.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1911,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place in Munich, good for a quiet stay away from the busy city !',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Terence','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1912,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place to stay in Munich ! Quiet and nice neighborhood! Caroline was very kind and response very quick ! Check in and check out wasn’t a problem ! Great and very cozy place inside ! We really enjoyed staying at this place ! Recommend! Thank you !',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Максим','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1913,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Caroline and Tobias were great hosts! The space was perfect for our short stay and first time to Germany! Everything was clean and comfortable and very convenient. We loved our first trip to Munich and having a great place to stay helped!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'McKenna','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1914,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The room is not big but it has everything you need! Super clean and cozy. Caroline is super friendly. And we had a nice stay in their place! The transportation is also easy, 3 mins walk to bus stop.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Wenjun','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1915,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This space was amazing and we appreciated it tremendously. It was very organized, clean, and functional while having many extra touches that made the place feel like home for a few days. They had very timely communication and much detail about the place and the area that we used on our visit. Just note that it is a little ways away from the airport, so plan the public transportation accordingly. Overall would highly recommend to anyone wanting to stay in Munich.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Kayla','https://www.airbnb.de/rooms/34928560/reviews','August 2019'),(1916,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, where do İ even start? First, location is great - just a few minutes away from a subway station and literally steps away from a bus stop. Very safe and quiet neigbourhood. İn terms of furnishment - we literally had everything that a prime hotel would offer and even more. İn addition to that, Carolina and Tobias were very helpful and kind. Bonus: They have a lovely garden where you can drink tea forever. Definitely will stay there next time as well',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Narmina','https://www.airbnb.de/rooms/34928560/reviews','August 2019'),(1917,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place is really nice, it is located in the garden of Caroline\'s house.\n\nThe flat is decorated very beautiful and has everything you could need: comfortable bed, TV with netflix, washing machine for clothes, kitchen with everything, etc..\n\nWe had an amazing stay with Caroline & Tobias, and both of them were really nice with us.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Julissa','https://www.airbnb.de/rooms/34928560/reviews','Juli 2019'),(1918,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Caroline and Tobias are phenomenal host. I stayed at there wonderful room for around a month and I loved it. Everything that you may possibly need for short or extended stays is offered. The communication is instant and they truly make sure that you are comfortable. Thank you guys for offering such a great spot!!! Also, the rooms is a bit colder than any of the rooms that I’ve stayed at in Munich this summer. Thanks again guys!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Phillip','https://www.airbnb.de/rooms/34928560/reviews','Juli 2019'),(1919,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great accommodation. We felt as at home. There is everything you need for home.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Zan (Jean)','https://www.airbnb.de/rooms/34928560/reviews','Juni 2019'),(1920,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','明亮舒服，房东热情好客，并为住户提供很充足的必需品，关于餐厅和游玩也会给很好的建议，就连防晒也准备了。洗衣机烘干机很好，四小时已经全部干了。停车位也充足，因为基本上就停路边。附近很多超市，有一家走路5分钟就到。会推荐给朋友。',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'威','https://www.airbnb.de/rooms/34928560/reviews','Juni 2019'),(1987,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful house all around in a country side setting. Large yard, fire pits, woods, and outdoor seating area are all very nice. The internet was about as expected of cable internet, fast enough downloads but fairly slow upload speeds.\n\nLike 5-10 minutes away from the little town with a few restaurants. ~1 hour away from a larger town. 30 minutes away from Canada.\n\nThe one dog is very lovely, the other takes some time to get used to you and is very energetic. There are apparently houses nearby that you can walk to see, but I did not get a chance to find them.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Kevin','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),(1988,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying at Jennifer\'s place was a real treat! The whole family is super friendly without being overbearing. Plenty of privacy in the thoughtfully appointed bedrooms if that\'s what\'s needed, and lovely chats over morning coffee as well.\nThe house is big and comfy and very clean. Being able to do laundry during my stay was quite helpful.\n\nJen and her family are quite knowledgeable about the area and have excellent advice on how to enjoy their little slice of heaven. If you\'re looking to get away from it all in a quiet town that somehow manages to have plenty to do, this is the place for you!!',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Christine','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),(1989,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Jennifer and her husband were wonderful hosts! Their house and my sleeping space were more than I could have asked for, and their location is perfect for exploring the North Maine Woods. I hope to stay here again next summer.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Robert','https://www.airbnb.com/rooms/46443466/reviews','July 2021'),(1990,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re in Northern Maine and need a place to stay, look no further. I was initially a little apprehensive to stay in an AirBnB with the homeowners, but I\'m so glad I chose to. Their house and property is absolutely beautiful. We enjoyed meals together, laughed together, and I learned a lot about the area.\n\nThey were so welcoming and friendly and it was perfect. Plus I made some new friends in the process.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Stacee','https://www.airbnb.com/rooms/46443466/reviews','June 2021'),(1991,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Had a very nice stay with a nice family at a beautiful home',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Kevin','https://www.airbnb.com/rooms/46443466/reviews','April 2021'),(1992,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you are looking for a home away from home, this is all you’ll ever need. This is the most welcoming home! The family and they’re puppies made my stay so wonderful. I am grateful for the comfortable bed, lovely dinners, and the laughter!',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Oly','https://www.airbnb.com/rooms/46443466/reviews','January 2021'),(2008,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Loved my stay here! A super cozy apartment and brilliant location in the center of old town Regensburg. The Danube is a minute walk away, plus an easy walk to restaurants, shops, and all around the “Altstadt”. The hosts, Johannes and Daniela, were super accommodating. I look forward to returning again.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Melinda','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2020'),(2009,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Host greeted at check-in. Very friendly, courteous, and helpful. Stylish, comfortable apartment. Highly recommended!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'John','https://sw.airbnb.com/rooms/37548154/reviews','Agosti 2019'),(2010,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne Wohnung in Top-Lage. Die Wohnung gut ausgestattet. Für die zentrale Lage ist es sehr ruhig, man bekommt nichts vom Innenstadtlärm mit. Die Gastgeber sind sehr freundlich. Ein Besuch lohnt sich!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Dennis','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2011,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Wohnung mit Flair. Ein Zimmer mit Bad. Viel Raum. ALLES da was man braucht. Johannes super freundlich, kommunikativ, AUFMERKSAM. Super Lage im Altstadt. Besser gibt es nicht Einfach top. Highly recommended.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Raphael','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2012,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfekte Unterkunft, perfekte Lage, supernetter Host, this is airbnb at its very best!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Adam','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2013,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wunderbar geeignet für eine Städtereise, da die Wohnung zentral und trotzdem ab vom Trubel gelegen ist.\nEs ist alles da, was man braucht, gute Restaurants, Einkaufsmöglichkeiten und die Donau sind in um die Ecke.\nDie Kommunikation war unkompliziert und der Empfang sehr nett. Wir kommen gerne wieder !',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Kerstin','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2014,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Johannes und Daniela sind wunderbare Gastgeber. Unkomplizierte Kommunikation und ein Wohlfühl Appartement im Herzen von Regensburg machen den Aufenthalt perfekt. Wirklich sehr zu empfehlen - vielen Dank!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Helga','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2015,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne kleine Wohnung mit Top zentraler Lage und alles da was man so braucht. Wir hatten ein paar schöne Tage in Regensburg.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Joshua','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2021'),(2016,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment was clean and in a very lovely, central location. The studio had a lot of great amenities and was perfect for a business trip. Johannes always communicated well and answered my questions. Would definitely stay again!!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Sarah','https://sw.airbnb.com/rooms/37548154/reviews','Agosti 2021'),(2017,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super zentral gelegene und gemütlich kleine Wohnung im Erdgeschoss. Man ist sofort in der Altstadt.\nAuch Johannes und Daniela sind sehr nett und stehen bei Fragen gerne zur Verfügung.\nDie Wohnung ist gut ausgestattet und sauber, wir kommen gerne wieder!',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Mika','https://sw.airbnb.com/rooms/37548154/reviews','Agosti 2021'),(2018,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Top Lage, sehr freundliche Gastgeber*innen, Wohnung hat alles was man braucht, sogar eine Waschmaschine und einen Kaffeeautomaten zur Mitbenutzung. Kleine Aufmerksamkeiten wie eine superleckere Schokolade und Knabbereien zum Enpfang machen einfach den Unterschied. Danke dafür :)',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Pia','https://sw.airbnb.com/rooms/37548154/reviews','Agosti 2021'),(2019,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren für eine Woche in Regensburg. Die Wohnung von Johannes war genau wie beschrieben und ist schön zentral gelegen mitten in der Altstadt. Wir haben uns sehr wohl gefühlt.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Anna','https://sw.airbnb.com/rooms/37548154/reviews','Oktoba 2020'),(2020,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mitten in der Stadt und trotzdem ruhig - top',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Peter','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2020'),(2021,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne kleine Wohnung mitte in der Innenstadt. Alles zu Fuß erreichbar. Liebvoll eingerichtet.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Cédric','https://sw.airbnb.com/rooms/37548154/reviews','Septemba 2020'),(2022,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Superlocatie, goede prijs kwaliteit verhouding. Johannes zou prijs best hoger kunnen stellen ivm superlocatie en ruim appartement. Alles wat je nodig hebt is aanwezig. Johannes reageert snel op berichtjes, is een superhost.',4.93,NULL,0,0,'2021-12-13 06:21:30','2021-12-13 06:21:30',0,1,NULL,'Helma','https://sw.airbnb.com/rooms/37548154/reviews','Agosti 2019'),(2167,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Der Blick vom Balkon ist unbezahlbar und die Lage ist klasse. Ich würde jederzeit wieder kommen.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ann-Christin','https://www.airbnb.de/rooms/21411333/reviews','September 2021'),(2168,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage in Hammersbach, nahe Höllentalklamm und Seilbahnen. Allerdings nicht an der Piste wie in der Anzeige beschrieben. Tolle Aussicht vom Balkon. Netter Kontakt zur Vermieterin, Schlüsselübergabe reibungslos. Nahe der Zugspitzbahnhaltestelle. Super Ausgangspunkt für Wanderungen.\nAusstattung im Wohnzimmer gut, Küche und Schlafzimmer sehr klein, für 3-4 Erwachsene\neher nicht zu empfehlen. Kochen nicht gut möglich, da nur 2 Herdplatten, Kaffeemaschine nicht nutzbar.\nSchlafzimmer nichts für Menschen mit Platzangst oder Großgewachsene. Bad ist okay.\nPreis-Leistungs-Verhältnis nicht angemessen, deutlich zu teuer für die Ausstattung und Größe der Wohnung.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Christian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2021'),(2169,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Eine wirklich tolle Unterkunft. Liebevoll und warm eingerichtet, mit allem was man braucht und sie ist perfekt gelegen. Würde ich jederzeit wieder buchen.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Eric','https://www.airbnb.de/rooms/21411333/reviews','Juli 2021'),(2170,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne gemütliche Wohnung, die mit Liebe zum Detail eingerichtet ist und von der Einrichtung alles bietet, was eine Ferienwohnung braucht. Küche sehr klein aber alles vorhanden, was man zum täglichen Kochen braucht.\nLage in Hammersbach absolut top zum Wandern, da man alle Wanderwege und Talstationen der Alpspitz/Kreuzeckbahn zu Fuß erreicht.\nWir haben uns in einer Woche Wanderurlaub sehr wohl gefühlt und können die Unterkunft nur empfehlen.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gloria','https://www.airbnb.de/rooms/21411333/reviews','September 2019'),(2171,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schöne Unterkunft mit einer fantastischen Aussicht vom Balkon. Wanderwege fangen in unmittelbarer Laufnähe an.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Frederik','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2172,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir haben hier zu viert vier schöne Tage verbracht, es ist alles genau so wie beschrieben. Ich finde es zwei Personen Ideal.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Frank','https://www.airbnb.de/rooms/21411333/reviews','März 2019'),(2173,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle, gemütliche Unterkunft, welche perfekt für einen kurzen Skiurlaub geeignet ist. Wir waren mit vier Erwachsenen dort und haben uns sehr wohl gefühlt.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gina','https://www.airbnb.de/rooms/21411333/reviews','Februar 2019'),(2174,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','ein sehr idyllisch gelegenes, nettes und durchdacht eingerichtetes Appartment',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Angela','https://www.airbnb.de/rooms/21411333/reviews','Juni 2018'),(2175,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten einen super Aufenthalt in der zwar recht kleinen, aber gemütlichen und super angebundenen (5min. bis zur Zugspitzbahn) Wohnung! Die Kommunikation lief super. Vielen Dank für die unverzüglichen Rückmeldungen und Tipps!!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Oliver','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),(2176,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne Wohnung in super Lage mit schneller Anbindung an die Zahnradbahn und zu Einkaufsmöglichkeiten.\nUns empfing der sehr freundliche und flexible Hausmeister für die Schlüsselübergabe. Die Wohnung war gemütlich möbliert und verfügt über eine gute Ausstattung (Smart-TV,Radio,Kaffee,Tee,Salz/Pfeffer etc.).\nZu beachten ist,dass die Wohnung für 4 Personen sehr knapp bemessen ist. Ebenso wie das Klopapier. Im Bad fehlte die Seife und in der Küche das Spüli. Außerdem wäre es von Vorteil gewesen sich vorab anhand eines Fotos ein Bild von der Küche (sehr kleine Zeile mit kleinem Waschbecken, mobile Herdplatte und winziger Backofen) machen zu können.\nBeim Ausklappen der Schlafcouch fanden wir unter dem Teppich eine nicht unerhebliche Menge Sand.\nDie zur Verfügung gestellten Hotel-Schlappen sollten gewaschen oder ersetzt werden.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Mara','https://www.airbnb.de/rooms/21411333/reviews','Februar 2022'),(2177,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very very clean flat, with comfortable bed and excellent shower, and a sofa bed in the living room that fits two children comfortably. There is a small kitchen with almost everything to do from a good breakfast or an easy lunch. And the highlight of this place, the pleasant living room with a stunning view to the Alpspitze and other mountains, really cool. Location is fantastic, close to a train station (3 min walking) in Grainau (the flat is very quiet), driving you reach the crowded Garmisch-Partenkirchen in 10 min and have access to supermarkets, restaurants and the ski lifts. Is a 4 season place I would say. Communication was good and clear. Thank you Romy !',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ernesto','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),(2178,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Good place for ones who want to ski in the area. Close to local train, which is 1 station to the ski area. Perfect for couples',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Andrei','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),(2179,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is suitable for 2 adults, can accommodate another 2 if the living room is equipped with a curtain (currently only half of the window is shedded with a curtain)',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Enyayaya','https://www.airbnb.de/rooms/21411333/reviews','Juni 2019'),(2180,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in Romy´s flat was like living in a fairytale...for a long weekend, anyway. The apartment is situated in Hammersbach, near Grainau, a perfectly small hamlet away from the craziness of G-P. It is quiet, peaceful, and bucolic. Beautiful walking trails are minutes from the door and the balcony delivers a stunning view of the Waxensteins. A little bit further away are the trails to Höllentalklamm and other trails that lead to Zugspitze. In fact, this flat is on the way to Zugspitze and Eibsee, so locationally, I thought it was perfect (you are also not far from the Bayerische Zugspitzbahn stop which takes you everywhere in the area). The flat itself was super cozy and perfectly equipped. While we are two smallish females, I could see where a tall person would feel claustrophobic due to the slant ceilings, but it worked for us. We wanted for nothing and this is the first AirBnB I’ve stayed in where I wouldn’t change a thing. Romy was very responsive and gave us tips on what to do in the area. I hope we can come back again!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Cecilia','https://www.airbnb.de/rooms/21411333/reviews','April 2019'),(2181,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We spent a hugely enjoyable 5 nights at Rommy\'s flat. Rather than stay in urban Garmisch, this place gives you a stupendous view of Zugspitze and Alpspitze. You are right underneath them and the lush surrounding forest. Listen for the sound of the stream when sitting on the balcony.\n\nIf you don\'t have a car like ourselves, you\'ll have to get your supplies from elsewhere as there isn\'t a supermarket you can pop out to (as far as I know). Shops down road in Grainau or next to Garmisch rail.\n\nAll in all, super place to stay.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Vik','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2182,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','?',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Metib','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2183,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment place is amazing and nearby train, bus and haiking mountain.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Mohammad','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2184,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is wonderful, the sofa bed was the most comfortable one we\'ve encountered. The location is perfect if you like hiking or cycling, and the main grocery stores are closer than they are to town. Great location.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gustav','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2185,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy provides a very cute and cozy apartment. The view from the balcony in the mornings is breathtaking. The ONLY very minor complaint was that the room the bed is in has a pitched ceiling so it’s a bit difficult to get in/out the bed or be in the room at all for anything other than sleeping. Other than that our stay was very enjoyable and Romy was a very sweet host.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ali','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2186,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A beautiful, cozy apartment. Very comfortable for two or three people. The balcony has a superb view of the Zugspitze and the apartment contains everything you would need for a short or long stay. The communication was perfect and the host was very helpful. The apartment is in an amazing location for visiting the mountains and lakes with the train and bus just a couple of minutes walk away. We couldn’t have asked for a better place to stay and very highly recommend the apartment.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2187,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great ambiance, lovely balcony with a great view on Zugspitze mountain.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Cees','https://www.airbnb.de/rooms/21411333/reviews','März 2019'),(2188,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice and tidy apartment with a great view over the mountains. More suitable for 2-3 people than 4 people. Great host that is replying on time and is willing to discuss any problem.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Petr','https://www.airbnb.de/rooms/21411333/reviews','Januar 2019'),(2189,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place with a view to Zugspitze! Perfect if you are for a hiking holiday!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Anton','https://www.airbnb.de/rooms/21411333/reviews','Januar 2019'),(2190,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy\'s home is very nice, the communication worked very well and the location is great if you are into skiing or hiking with the closest lifts just a 15-minute stroll away and train to other lifts even closer than that.\nThe flat has two drawbacks though, which makes me think the value is not fantastic. First, the heavily sloping walls can make life quite uncomfortable - I was literally unable to stand up in any part of the bedroom and bending over to cross the room is not necessarily what you want when your body aches from yesterday\'s skiing. Second, we experienced significant rain in the mountains (for which I am not going to blame Romy) and found no appropriate place to dry the wet skiing jackets and pants. If you bring your own skis and boots, space constraints are going to be even more of an issue.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Niels','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),(2423,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What to say... This is art in architecture:) Was a pleasure to spend a night in this (bird)box for people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Matej','https://www.airbnb.ca/rooms/34692739/reviews','May 2022'),(2424,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in this birdbox, in front of this stunning view makes you feel really calm and blessed for being there. It is an once in a lifetime experience sleeping and waking up deeply in the wild nature of Norway. Torstein had been a perfect host responding almost immediately to our messages. He even found a way to satisfy our desire to have a shower during our stay there. I wish that all hosts were like him.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nikos','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2425,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Clearly you book this place for the views and unique accommodation! Sunset was the best, and we didn’t realize there was a little campsite next to the Birdbox where you can use the firewood and grill dinner if you purchased groceries in town. The bathroom area is in the barn nearby, which is also where we kept our belongings since the Birdbox only has a few feet space outside of the bed. Be sure to bring only what you need in a backpack, as the Birdbox is 200 meters away from the parking area and can be steep if you’re trying to bring up any luggage. Bed was very comfortable with plenty of pillows and blankets, and heating was nice. Would recommend to anyone who also loved to drone—we took some amazing photography and video footage!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Laura','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2426,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Incredible stay, the views are even better in real life!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Matt','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2427,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Torstein\'s #birdbox is beautifully situated and offers a great view of the fjord. There is even a fireplace on the small veranda, which further enhances the whole experience. The interior is extremely comfortable and cosy.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mario','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2428,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fairytale place! We really loved the location and the view, a fantastic place for a staycation away from home. Even though it was raining most of the time we still lit a bonfire in between the rainfall. It was magical. Torstein responded quickly to any request, gave clear instructions and sorted out a problem we had in a smooth manner. Some minor stuff in the Birdbox should be repaired for an even better impression - but the view and the calm of the place is wonderful and trumps it all. Recommend!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Linda','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2429,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was like sleeping in a gallery with an ever changing masterpiece of landscape painting.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Bjørn','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2430,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfekt «get-away» ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Caroline Christine','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2431,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A pleasant stay, even though it was raining heavily, the view was amazing. Definintely recommend!! ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aurelija','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2432,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What a stunning place! The view and the sunset was incredible.\nI loved being up in the hills and just listening to the cow bells in the valley.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Chloe','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2433,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','10/10',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Helene Håheim','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2434,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stunning view, highlight of our roadtrip.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Dorian','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2435,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Was really amazing and special\nWe stayed there since check in and left at check out it was truly incredible. I will never forget it! Also the owner was really fast and reliable in responding\nOnly wish I would have had is to know a bit better on what kind of food we can bring as there is only a mini gas bottle and a grill',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Louisa','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2436,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice location, with a superb view. Good communication throughout. Would recommend!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Joachim','https://www.airbnb.ca/rooms/34692739/reviews','July 2021'),(2437,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and great atmosphere. Such a charming place to relax.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Martine','https://www.airbnb.ca/rooms/34692739/reviews','June 2021'),(2438,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing experience.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Athul S','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2439,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely one night stay at the birdbox. We arrived to bright blue skies and sunshine, and woke up to a little bit of snow in the morning! This is a wonderful place to stay, whatever the weather :D',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Hannah','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2440,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Evelina','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2441,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful view and perfect glamping experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Leslie','https://www.airbnb.ca/rooms/34692739/reviews','April 2021'),(2442,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I have been impressed ‼️',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mantas','https://www.airbnb.ca/rooms/34692739/reviews','April 2021'),(2443,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','JUST DO IT!!! We’ve been considering this for awhile now and we are so glad we made the trip to do it. It was the most relaxed we have been in quite some time. The entire set up was cozy and well thought out. The (Website hidden by Airbnb) AMAZING. I told my fiancé we are getting one because this is hands down the best bed I’ve ever slept in. Could have slept in here all day long.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Morgan','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2444,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect??',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Violeta','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2445,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Torsteins bird box was everything and more than we wanted! Outrageously beautiful views no picture will benefit it. There is a fireplace outside and a little area where you prepare food or cook food on the fire. Extremely quick and helpful response time from Torstein. Already getting ready too book again',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Connor','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2446,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Surprised my girlfriend and our newborn with a stay at the Fauske Birdbox, March 14-15. The weather was perfect for sunset, starlit night sky and beautiful sunrise. Couldn’t be happier with the decision!\n\nCommunication with Torstein and check-in/out was excellent.\n\nPerfect to spice up a roadtrip/vacation or as a surprise gift for someone special :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aleksander','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2447,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sure, it was beautiful and the location was great. There was access to small cabin with some amenities and a bathroom. Very photogenic.\n\nOur cabin was said on this page to have some source of heat, however we have now spent the night in a freezing cold \"Birdbox\". Of course we searched for ways to heat the place up, however the only oven we found was hidden under the bed behind some walls and obviously not meant for us to find or adjust. There were no higher settings on the oven either. This should obviously be clearly stated on their page on Airbnb as people do risk getting sick.\n\nThe birdbox was also filled with condensation and everything was completely wet, with water running down the windows that covered the walls.\n\nIkke verdt den stive prisen, med tanke på dugg, fukt og kulde som burde være minimumsstandard. Veldig (Hidden by Airbnb) -vennlig da! Sikkert verdt det om våren/sommeren.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erik','https://www.airbnb.ca/rooms/34692739/reviews','November 2020'),(2448,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great all over! Beautiful cabin with a stunning view.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Emilie','https://www.airbnb.ca/rooms/34692739/reviews','November 2020'),(2449,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very cozy place with a great view!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Stian','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2450,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nothing worthwhile in life is easy. If you want something spectacular be prepared to put the effort in and you will not be disappointed.\n\nThe elegantly simple design of what is essentially a bedroom (no, there is not an en suite) sits proudly on a landscape but doesn’t compete or offend nature. This is a celebration of how beautiful Norway is and offers visitors the chance to lose themselves in wonder.\n\nThis is a place for one or maximum two people - it is just a large bed in a box. But what a place.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alan','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2451,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a truly lovely experience! One of a kind place to go to sleep and awaken to spectacular views. Highly recommend a visit.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Kelsey','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2452,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice view and it’s a perfect place to stay for a night',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Yasmeen','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2453,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place have left for us amazing impression',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Tomas','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2454,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view was absolutely amazing in the morning and throughout the day. lovely weekend gateway location locating in a stunning region of Norway.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Fanny','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2455,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It\'s a sin to go to sleep before darkness!!! That view!!!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Baiba','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2456,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This birdbox cabin was absolutely incredible. The view was even better than expected, we had a great time. We stayed two nights and I think that was a great amount of time for people looking for a little getaway from reality. We highly recommend staying here, it was worth every cent.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Christine','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2457,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The birdbox is amazing! Location, the box itself and the view (especially during sunset) make it an unique experience.\nWe really enjoyed our stay there.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Julia','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2458,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great view and cozy cabin. For the short hike up to the box you definitely need to bring proper shoes if it rains!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lena','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2459,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We spend our last night in the Birdbox and it was wonderful. By far the most spectacular night of our holiday and the view was fantastic. Torstein is also very easy to communicate with and provides you with all the information you’ll need to get there and have a nice stay.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gijs','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2460,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful place, and a nice little cabin/box. I highly recommend it! The view is even better in real life!:)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erik','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2461,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing place, and an amazing view. Cozy little cabin, and a small functional kitchen located nearby. Tip top! :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Arnfinn','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2462,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and atmosphere! Loved our stay at this unique place. Fell asleep listening to raindrops tapping the ceiling and watched how the weather changed over the fjord.\n\nTip! We brought our own casserole and other cooking equipment to make food. There is no fridge there so bring a cooling bag if you have food that needs to be cold.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Metock','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2463,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Awesome views!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Moquan','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2464,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is absolutely amazing! The view is maybe the best I have ever seen!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Torstein','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2465,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','An experience definitely worthwhile! Felt so close to nature, yet safe and warm inside the birdbox. Torstein is easy and quick to communicate with, and a great host. Will recommend it to friends and family for future excursions.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alice','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2466,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place to enjoy nature with stunning view from our bed in a very relaxing and peaceful place. We definitely will go back!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jose Eustaquio','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2467,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great view, great location, great host. All in all a great experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eirik','https://www.airbnb.ca/rooms/34692739/reviews','May 2020'),(2468,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and a very comfy bed, make sure to bring walking boots as it’s a short but muddy walk, and ensure to go in the daylight as it was quite awkward in the dark! However the whole place made up for it ten times over, the view was out of this world and we would definitely go back again!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Rhys','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),(2469,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Magical place to sleep. View is amazing.\nAlthough we think this place is better in summer then winter because it very cold in winter and its getting dark sooner. The place is not easy to reach in the dark.This place is perfect for hikers and people who are used to do camping. There is no shower, its back to basic but its al very worth it!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Cheyenne','https://www.airbnb.ca/rooms/34692739/reviews','December 2019'),(2470,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','OMG! This place is insane! We had a great stay and the morning view of fjords and mountains will stay with us for years to come. Truly a magical experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Kevin','https://www.airbnb.ca/rooms/34692739/reviews','December 2019'),(2471,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you are looking for a experience to remember this is the place. The location is outstanding, despite being just a room it was very confortable and cosy. Will recommend to anyone.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Willevans898','https://www.airbnb.ca/rooms/34692739/reviews','November 2019'),(2472,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A truly spectacular location. Words can’t describe how beautiful the views are. Warm and cosy even during our stay at the end of October. We brought enough food and drink to last us a couple of nights but the nearest town isn’t far away to stock up if you’re staying a bit longer. Great communication from Torstein. Would highly recommend! One point to consider; best to arrive in the hours of daylight or bring a good torch!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Melissa','https://www.airbnb.ca/rooms/34692739/reviews','October 2019'),(2473,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing location, amazing views, especially inside of the bird box its breathtaking.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lisandra','https://www.airbnb.ca/rooms/34692739/reviews','October 2019'),(2474,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, what an experience. A view we will never forget. Was truly amazing.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nicola','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2475,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is amazing.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Hsiang Hsuan','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2476,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A fantastic glamping experience, highly recommended for a stay somewhere out of the ordinary. The sunset and dawn views were beautiful.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'David','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2477,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Awesome space, made even moodier by the weather. Great stay, would definitely recommend. Good boots needed to get up there in the wet, but well worth it! Thanks!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Chris','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2478,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We loved our stay at the Birdbox - it was beautiful and really an interesting space. We had all we needed and loved watching the sun come up over the fjords. It was nice and warm, and the rain made it cozy. We’d love to stay again!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alyssa','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2479,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The real landscape box',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ryo','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2480,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and overall outdoor experience. Loved the cows nearby and the comfortable bed. Highly recommend this to other visitors.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erin','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2481,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view from this place is unbelievable! The bed is super comfortable and the room is very stylish. It is a great place to go glamping!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eileen','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2482,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The Bird Box is an unforgettable, one of a kind experience. The view at dusk and dawn is worth every inch of the muddy hike up. So glad we did this. Highly recommend.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Andrew','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2483,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re thinking about staying here go ahead and book it. This place is beautiful and I won\'t forget the views.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Brad','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2484,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We love unique airbnbs, so we booked this one :-) Our expectations have been exceeded, this place is truly unique and beautiful! Its a once in a lifetime experience. Watching the sunset and the moon during the night was amazing. Every morning we were woken up by some lovely sheep in front of our cabin and the cows were also very cute! The interior in the cabin is really comfy and it‘s protected from the wind. However pack some warm clothes because its getting quite cold there during the night (4 degree in august :-D) and some hiking shoes to get up there. Thorstein, thank you for building and offering such a great place to other people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gabi','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2485,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Don\'t even think twice about it. We can guarantee that this\'ll be one of the most spectacular places you have ever slept. Just make sure you bring your rain boots and a good bottle of wine... This is one is a no brainer!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ann Christin','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2486,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We leave our highest recommendations for Torstein!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Sarah','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2487,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Semt to be a great expericene.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Patricia','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2488,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place to get away from everything. Can only recommend as the view is spectacular!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Niklas','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2489,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A truly memorable experience! Secluded and idyllic location and lovely little touches from the host such as coffee/tea and candles. Already thinking about returning in the winter :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mena','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2490,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The bird box is definitely unlike anywhere we\'ve stayed before!\n\nWe watched one of the best midnight sunsets of our lives against the mountains as we fell asleep. The view is incredible, even better than the pictures can show.\n\nBring some good hiking shoes, preferably water proof. It\'s a short hike to the box, only about 200 meters, but the path can be very muddy and the terrain uneven.\n\nIt may be a little rustic for some people\'s taste but I think that\'s obvious from the description and pictures. The view is definitely worth it though!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ray','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2491,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Truly unique experience. Mind blowing view. Highly recommended!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jack','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2492,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing place to stay. Beautiful view from the bird box no matter what the weather is like. Nice comfortable bed great experience will definitely stay again',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Martin','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2493,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is truly outstanding. The pictures does not do this place justice. It is even better. We were a bit unprepared for the little walk up to the box as was raining a lot and the grass was really wet and damp. Torstein gave us the heads up so we could use the simple yet effective solution of plastic bags on feet. Really appreciated. Really highly recommendthis place. Stunning views and a different stay for a perfect memory with my husband.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nancy','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2494,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a magical experience! I spent an evening and night watching the changing weather and the shifting of light, comfortly inside the birdbox, with a beautiful view of the mountains and fjord. And with cows and sheeps grazing in the green hillside just below the box. The interior was high quality, very comfortable! The toilet in the summerbarn located just nearby was a nice, clean and practical solution. The short hike up to the birdbox was easy, just long enough to give a hideaway-feeling. This is unique, life felt so uncomlicated here, and I highly recommend a stayover.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Liv-Anne','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2495,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Une vue incroyable !',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Clara','https://www.airbnb.ca/rooms/34692739/reviews','May 2022'),(2496,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Den nydelegaste utsikta!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gro','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2497,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utrolig koselig birdbox med fantastisk utsikt.\nGodt laget til med toalett og en enkel, men praktisk kjøkkenkrok.\nFin plass til å bruke stormkjøkken utenfor birdboxen. Kommer gjerne igjen!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Charlotte','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2498,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lisbet','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2499,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde det helt magisk! Var så heldig å få med oss en nyydelig rød solnedgang. Enorm seng å boltre og kose seg i. Utsikt hvor enn vi så! Veldig bra laget til med kjøkkenbenk i sommerfjøsen ved siden av så man kan lage mat og ha god plass. Vi våknet til strålende sol så vi tok like gjerne frokosten ute. Vi hadde det så fint og vi kommer definitivt tilbake.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Camilla','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2500,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dyrt med tanke på at man ikke har tilgang til sikkelig dusj eller andre fasiliteter, men veldig fint og absolutt noe vi vil anbefale videre til andre. En unik opplevelse!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Natalie','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2501,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Strålende opphold med en fantastisk beliggenhet! Torstein svarte veldig raskt på eventuelle spørsmål vi hadde underveis. Anbefales!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Torry','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2502,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unikt sted!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Emil','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2503,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk sted, vi fikk full uttelling med været og nøt vært sekund av oppholdet. Lett å finne, god og rask kommunikasjon med verten.\n\nSkal man sette fingen på noe så må det bli prisen.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Marius','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2504,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nydelig natur, fantastisk utsikt og en flink og nøyaktig vert',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Krister','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2505,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Kjempefint opphold i fantastiske omgivelser.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alisa Elinora','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2506,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Må oppleves! Knall utsikt, helt likt som på bildene, og er en utrolig opplevelse uansett vær og årstid!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Anna','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2507,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Kjempefint opphold og fantastisk utsikt. Bålpanne like utenfor og tilgang på ved og primus.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'May Tone','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2508,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Et helt fantastisk opphold! Fikk raske og grundige svar fra verten Torstein. 10/10 opplevelse.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Silje','https://www.airbnb.ca/rooms/34692739/reviews','November 2021'),(2509,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk utsikt! Enkelt å finne frem og flott tilrettelagt. Kort å gå fra bilen, men ligger likevel for seg selv. Anbefales!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Audun','https://www.airbnb.ca/rooms/34692739/reviews','November 2021'),(2510,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Esperienza molto suggestiva e caratteristica. Panorama mozzafiato così come si vede in foto, una piccola stanza immersi nella natura dei fiordi norvegesi.\nStanza calda e confortevole\nConfort molto Spartani essendo immersi nella natura. C\'è un lavandino con dell\' acqua in un recipiente, un barbecue per cuocere qualcosa sotto le stelle, un tagliere, un coltello e poche altre cose essenziali.\nNon c\'è la doccia\nUnica nota è il prezzo che è troppo alto per il servizio offerto',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Marco','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2511,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nydelig utsikt og koselig Birdbox. En uforglemmelig opplevelse!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jeanett','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2512,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Birthe','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2513,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Kjempeflott birdbox med nydelig utsikt, selv om været ikke var helt med oss. Flott med tilgang på stormkjøkken, ved og rent vann☺️',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Isabel','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2514,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stargazing mot en klar nattehimmel, mild morgen gry over den maleriske naturkulissen med fjelltopper, dalen og fjorden. Ro i sjelen plass ❤️?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lisbeth','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2515,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi fikk flott oppføling og raske svar på spørsmål av verten Torstein. Birdboxen er nydelig plassert med flott utsikt, og den var ren og pen. Det var godt tilrettelagt med ved og bålpanne, og primus og kjele for koking av te og kaffe på morgenen. Kommer gjerne igjen.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ragnhild','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2516,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Flott sted, bedre utsikt!\n10/10 vil anbefale. Kjempe hyggelig host',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Emilie','https://www.airbnb.ca/rooms/34692739/reviews','September 2021'),(2517,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde det helt fantastisk, var litt uheldig med været på morningen men solen tittet frem etterhvert. Og får en utsikt, anbefaler veldig å ta turen ? Og Torstein var rask med å svare på det vi lurte på.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aisatou','https://www.airbnb.ca/rooms/34692739/reviews','September 2021'),(2518,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','D