https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2558,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fornøyd ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Camilla','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2559,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Hvis du vurderer å dra, gjør det! Den perfekte utflukten fra hverdagen!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ingvild','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2560,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde en flott overnatting oh det var et fantastisk sted!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Monica','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2561,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dette var en helt magisk opplevelse. Jeg og kona feiret Valentines day, og dette er noe vi aldri kommer til å glemme. Utsikten må være en av verdens beste, og både landskapet og himmelen viste seg på alle måter. Fra solnedgangen på ettermiddagen, til å sovne under stjernehimmelen, og til å våkne til ett fantastisk fargespekter over fjellene og utover fjorden. Absolutt verdt hvert eneste minutt. Alt var godt tilrettelagt. Birdboxen kunne til tider bli litt varm (til tross for 10-15 minus ute), men når vi fikk taket på innstillingene på panelovnen, så gikk det bra. Alt var rent og fint. Det var lagt frem ved og utstyr til opptenning av bålpannen, og det benyttet vi oss av under stjernehimmelen. Utrolig opplevelse å sitte ved bålpannen under stjernehimmelen på kvelden. Toalettet var litt vanskelig å få til å virke skikkelig, trolig på grunn av kulden, og at pumpen ble frossen. Det var godt lagt til rette med primus til å varme vann til kaffe, vask eller andre ting. Eneste problemet vi hadde var at veien opp til parkeringsplassen var svært bratt og glatt, så vi kom oss ikke helt opp. Men vi fikk hjelp av en nabo, og fikk parkere ved en fjøs lenger ned i bakken. Alt i alt en uforglemmelig opplevelse.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Frank Willy','https://www.airbnb.ca/rooms/34692739/reviews','February 2021'),(2562,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Flott hytte og beliggenhet. Vi har kost oss med brettspill (medbragt) og utsikten ??\n\nDo/kjøkkenfasiliteter er forbedringspotensial. Lurt å ta med støvler/fjellsko da det er gjørmete opp til hytta.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mali','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2563,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde ei herleg oppleving i birdboxen. Veiret var flott og utsikta var så fantastisk at vi vart heilt oppslukt. Vi hadde med eigen gassbrennar og anna utstyr til å lage mat. Det er ein sommarfjøs like ved med ein benk vi brukte til å lage mat. Det var godt å kome seg vekk litt i desse tider og få oppleve noko nytt utan å måtte reise så langt. Anbefalast!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Astrid','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2564,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utrulig flott opplevelse, med ein fantastisk utsikt. Kan virkelig anbefales',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jon','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2565,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk opplevelse! Lett å finne, varmt og koselig i Bird boxen. Vi koste oss med den flotte utsikten. Hadde med oss sønnen vår på 1 år som synes at det var veldig stas å se ut gjennom alle vinduene og hoppe i den store senga :) Anbefales!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eva','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2566,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Flott opplevelse! Deilig å våkne til den utsikten ☺️',