01','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk utsikt og sted. Helt unikt! Enkle kår mtp toalett/kjøkkenfasiliteter. Kan absolutt anbefales. God og rask kommunikasjon med vert.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nimo','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2610,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nydelig utsikt og en morsom opplevelse. Boksen er en del mindre enn vi hadde forestilt oss, og det blir fort varmt/dårlig luft på en varm sommerkveld. Funket bra for 1 natt, men prisen er litt stiv i forhold til fasilitetene.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Christoffer','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2611,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fint, rent og moderne. Helt fantastisk utsikt! ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Linda','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2612,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk utsikt, skinnende rent, og kult konsept. Selve Birdbox\'en er veldig stilig, men den var mindre enn først forventet. Det blir også veldig varmt der inne når sola skinner. Vannet som sto på bordet var varmt, og vi måtte ha døren på gløtt om natta. Det er ikke noe sted å oppbevare matvarer som er avhengig av kjølig temperatur. Det er bare ett håndkle. Og varm mat må kokes eller stekes på primusen i fjøset. Så ble litt skuffet når vi hadde kjøpt med oss melk, smør og egg til frokosten. Ellers var oppholdet greit',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Henrik','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2613,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Oppholdet på birdbox Fauske var helt magisk. Utrolig fin opplevelse! Takk til Torstein for god info på forhånd slik at det ble superenkelt å finne frem. Anbefales sterkt for de som vil ha en hytte utenom det vanlige.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Anita','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2614,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unik opplevelse i enestående natur og utsikt!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eline Benno','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2615,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Helt fantastisk utsikt, og en unik opplevelse! Lettvint å sjekke inn og ut og det lille ekstra som verten har organisert. Kan nok bli veldig varmt i fint vær, men vi var heldige med været!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ine','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2616,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk sted med episk utsikt! Fantastisk tur! ☺️',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Marthe','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2617,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk sted i vakre omgivelser!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erlend','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2618,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En veldig fin opplevelse uten om det vanlige! Utsikten er som på bildene, og fantastisk å både sovne og våkne til. Vi hadde med både sitteunderlag og campingstoler til den lange lyse sommerkvelden, dette anbefales. Kan absolutt anbefale dette stedet!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Renate','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2619,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','HELT FANTASTISK! Vell verdt pengene, og opplevelsen / utsikten fra boksen kommer vi aldri til å glemme! Nydelig fra start til slutt!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Julie Ovidia','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2620,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En fantastisk opplevelse og utsikt som er vanskelig å beskrive med ord, må oppleves!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Manar','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2621,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Helt fantastisk utsikt!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Svanhild','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2622,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk opplevelse!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Åsmund','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2623,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En fantastisk fin opplevelse! Veldig kult konsept! Vi har virkelig kost oss. Rent og fint. Helt greit toalett med en vask med såpe og vann i sommerhuset. I sommerhuset var det og en primus, skjærebrett, kniv, kaffepulver, te, vann og to kaffe/te krus. Det er lys både i sommerhus og birdbox, samt en lykt i begge bygg. I birdbox var det en vannkaraffel og to vinglass. Nydelig utsikt å både sovne og våkne opp til!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jeanette','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2624,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk overnattingssted der man virkelig føler seg i et med naturen.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Truls','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2625,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Helt fantastisk!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ola','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2626,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nydeleg plass, i nydelege omgjevnadar! Med været på topp, blei dette verkeleg ein minneverdig tur med følelsen av å leve i ein draum! ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Stein Slettemark','https://www.airbnb.ca/rooms/34692739/reviews','May 2020'),(2627,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Bra sted',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lars','https://www.airbnb.ca/rooms/34692739/reviews','May 2020'),(2628,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Virkelig en nydelig plass som må oppleves.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Kristianne','https://www.airbnb.ca/rooms/34692739/reviews','April 2020'),(2629,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utrolig minneverdig opplevelse. Anbefales sterkt!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jonas','https://www.airbnb.ca/rooms/34692739/reviews','April 2020'),(2630,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utruleg flott oppleving å vere her. Heldige med vêret, men trur det hadde vore flott uansett. Koseleg lite \"hus\", og koseleg med lys og glass som var sett fram. Heilt magisk med ein himmel full av stjerner på natta! Slik får du det ikkje i byen.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Marie','https://www.airbnb.ca/rooms/34692739/reviews','April 2020'),(2631,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk overnatting i Birdbox. Vi fant roen og senket skuldrene fort. Takk for en uforglemmelig opplevelse. Vi ses igjen',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Christian','https://www.airbnb.ca/rooms/34692739/reviews','April 2020'),(2632,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Odd Arne','https://www.airbnb.ca/rooms/34692739/reviews','February 2020'),(2633,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','10 av 10 på unik overnatting! Dette må du se! Det er godt skiltet underveis til gården, og ca 5-7 minutters gange fra parkeringsplassen.\nVi var der i februar og fikk en liten gjørmete vei til birdbox men når du kommer til toppen er turen verdt det. Den er liten og kompakt, men du har en herlig seng og en utsikt du ALDRI VIL GLEMME! Vann og stearinlys stod klart, samt utallige tepper for å holde oss varm. Vi hadde lest på forhånd at birdboxen kan opplevels kald så vi hadde gode klær, men det er nok tepper til å kle seg inn og bare kose seg!Verten svarte oss umiddelbart ved spørsmål og var opptatt av at vi skulle ha det bra. Selv med en stormfull natt (som var litt kjedelig når man må ut i det andre huset for å gå på toalettet midt på natten) hvor vi hørte alle vindkast og tordenvær - var opplevelsen noe vi aldri ville vært foruten. Selve stormen gjorde det bare spennende. I huset ved siden av har du toalett og mulighet til å lage kaffe.\nVi fikk en flott morgen dagen etter. Å se Norge våkne til sol og lys om morgen er magisk! Og det får du her!\nJeg tok med min mann på overraskelsestur hit, og den ble veldig godt imottatt.\nAnbefales på det sterkeste!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Anniken','https://www.airbnb.ca/rooms/34692739/reviews','February 2020'),(2634,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','En opplevelse du sent vil glemme! ?\nFikk virkelig slappet av, ladet opp batteriene!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eline','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),(2635,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Hadde én natt i birdboksen. Fantastisk utsikt som var magisk å våkne til. De har noe å gå på ift. fasilitetene, men renger med at det fikses etter hvert. Lurt å ta med varme klær :-)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Øyvind','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),(2636,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dette oppholdet var helt fantastisk. Ryddig, rent, og konseptet i seg s