r uns dann hoffentlich kennen. ;-) Die Lage ist wirklich super! Der Bahnhof & Restaurants sind in wenigen Minuten zu Fuß zu erreichen.\nIm Hochbett schlafen, ist aufregend und es war alles sehr sauber!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Samira','https://www.airbnb.de/rooms/48268802/reviews','Oktober 2022'),(2848,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Kommunikation hat sehr gut funktioniert und wir haben alle wichtigen Infos im Voraus bekommen. Elsa war sehr freundlich und hat schnell reagiert. Die Wohnung ist sehr groß und modern und wir waren alleine dort. Auch die Lage war perfekt: direkt am Bahnhof und nur 20min zum Startpunkt der Zugspitzen-Wanderung. Wir durften unser Gepäck auch nach dem Check out noch in der Wohnung lagern, was uns sehr geholfen hat.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Leonie','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2849,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren dort wegen der Zugspitze und die Wohnung hat dafür ne super Lage. Die Wohnung erfüllt alle Kriterien wie beschrieben.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Deniz','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2850,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne Wohnung, perfekte Lage, unkompliziert!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Hauke','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2851,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa ist kommunikativ und hilft bei allem Fragen weiter. Obwohl ich ein wenig eher da war, konnte ich schon in die Wohnung. Der Check-In war unkompliziert.\nDie Lage ist super und dient als gute Ausgangslage für Wanderungen - vor allem wegen der Nähe zum Bahnhof und den Bussen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Anna-Lena','https://www.airbnb.de/rooms/48268802/reviews','Augu