 Vorderseite des Hauses befindet sich im Bau, daher ist es ein wenig vage zu finden, aber\n(Wenn du es nicht finden möchtest, frag einfach die Nachbarn, die vorbeikommen, und sie werden wirklich freundlich mit dir kommen. Es gibt hier eine Menge Airbnb-Unterkünfte.)\nEs gibt auch einen großen Lebensmittelladen innerhalb von 5-10 Gehminuten.\nMir hat es gefallen, weil es viele Arten von Dingen gab und es billig war!\nAn der gleichen Stelle wie die Zukshupeche Ticket Boothsdu (?)\nDu kannst in kürzester Zeit dorthin kommen, Job.\nDie Waschmaschine ist auch frei verfügbar, so dass es gut ist.\nGute Lage,\nsauberes Gebäude & Zimmer\nFreundlicher Gastgeber & Nachbar',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'정인','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2911,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsas Haus ist super komfortabel und großartig gelegen. Es war ein wenig schwierig einzuchecken, vor allem, weil die Straße im Bau war, aber Elsa war sehr reaktionsschnell. Wir liebten den kostenlosen Parkplatz auf der Straße! Die Unterkunft ist super sauber und mit allem Notwendigen ausgestattet. Wir würden auf jeden Fall wieder hier übernachten!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2912,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich habe eine tolle Zeit bei Elsa verbracht. Die Wohnung ist nur wenige Gehminuten von der Bushaltestelle und dem Bahnhof entfernt. Ganz in der Nähe eines Lebensmittelgeschäfts. Die Lage ist fantastisch. Elsa war jederzeit erreichbar, wenn ich Fragen hatte, ob es nun darum ging, meinen Weg zur Wohnung zu finden oder die Waschmaschine zu benutzen. Die Wohnung war sehr gemütlich und komfortabel, ich fühlte mich wie zu Hause. Leider habe ich Elsa und ihre Tochter nicht kennengelernt, vielleicht das nächste Mal!! Ich würde sehr empfehlen, während deiner Reise nach Garmisch-Partenkirchen bei Elsa zu wohnen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Shreya','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2913,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Der Aufenthalt war sehr schön und ruhig, gute Lage und sehr detaillierte Check-in- und Aufenthaltsanweisungen, leider habe ich den Gastgeber nicht persönlich kennengelernt!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Ryan','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2914,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Toller Ort für meinen kurzen Aufenthalt. Ich habe es geliebt, alle Nachbarn unter dem Balkon spielen zu sehen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Anthony','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2915,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Netter und herzlicher Gastgeber',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Prasath','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2916,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Lage ist sehr günstig, ein 3-minütiger Spaziergang vom Bahnhof Garmisch entfernt, der Eingang ist hinter der Jugendherberge, es ist ein Ferienhaus, das Haus ist sehr sauber, aber wir hatten nicht viel Glück, als wir eincheckten, wir haben keine WLAN-Informationen zu Hause gefunden, so dass es am Tag des Check-ins kein Internet gab (vielleicht hat der vorherige Gast es verloren), alles andere war in Ordnung, Elsa war sehr hilfreich bei der Lösung unserer Probleme, es war praktisch, zum Lake Abu und Chug Peak zu gehen, wenn du dem nächsten Mieter hilfst, aufzuräumen und das Zimmer zu reinigen, kannst du auch einen Rabatt von 20 Euro erhalten, der zu einem positiven Zyklus beitragen wird',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'木木','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2917,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war fantastisch - genau wie beschrieben!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Bill','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2918,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Toller Gastgeber und sehr komfortable Wohnung, extrem zufrieden.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Gabriele','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2919,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsas Wohnung war toll und befand sich in einer sehr günstigen Lage. Elsa war eine großartige Gastgeberin und half mir mit allen Informationen, die ich brauchte, um durch die Unterkunft zu navigieren.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Karthik','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2920,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage mitten in der Stadt neben dem Bahnhof, aber dennoch in eine sehr ruhige und niedliche kleine Wohngegend eingebettet.\nElsa war eine großartige Gastgeberin, hat sofort geantwortet und uns geholfen, die Wohnung zu betreten, bevor sie ankam. Wir konnten die Gemeinschaftsküche nutzen, um unser Abendessen und Frühstück zu kochen, und die Wohnung war geräumig und sehr schön.\nKann die Unterkunft jedem für einen Aufenthalt in dieser schönen Gegend empfehlen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Maximilian','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2921,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gut gelegene Wohnung in der Nähe des Bahnhofs und aller Annehmlichkeiten von Garmisch. Tolle Kommunikation vom Gastgeber durchgehend. Eine komfortable Unterkunft, um die nahegelegenen Berge und Sehenswürdigkeiten zu erkunden!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Seán','https://www.airbnb.de/rooms/48268802/reviews','August 2022'),(2922,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich verbrachte einen wunderbaren Aufenthalt bei Elsa! Ihre Unterkunft war sehr schön und gemütlich. Sie war sehr zuvorkommend und gab großartige Vorschläge für Wander-/Laufwege, um die Landschaft zu genießen. Sie war sehr kommunikativ und hilfsbereit, wenn ich Fragen hatte. Ihre Unterkunft war sehr neu und modern und hatte alles, was ich für meinen Zwischenstopp brauchte. Ich würde definitiv wieder hier übernachten!!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Danielle','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2923,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, in der Nähe des Bahnhofs und Busbahnhofs und im Grunde zu allem. Und Elsa war ein wunderbarer Gastgeber',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Luis','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2924,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','brillanter Aufenthalt, tolle Lage und wirklich fürsorglicher und hilfsbereiter Gastgeber!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Owen','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2925,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa war eine wunderbare Gastgeberin und sehr reaktionsschnell und hilfsbereit. Ihre Unterkunft ist schön und modern und hat schöne elektronische Jalousien, um einen erholsamen Schlaf zu bekommen.\nDieser Ort ist etwa 15 Gehminuten vom Hauptteil der Stadt mit Geschäften und Restaurants in Garmisch und nur ein oder zwei Blocks vom Bahnhof und einer anderen Gegend mit einigen Restaurants entfernt.\nWahrscheinlich Benutzerfehler, aber ich konnte die Waschmaschine nicht zum Laufen bringen, da Elsa während meines Aufenthalts nicht da war. Das wäre nur etwas, das du im Voraus besprechen solltest, wenn du weißt, dass du sie brauchen wirst. Trotzdem hat Elsa so hart mit mir gearbeitet, um mir zu helfen, es aus der Ferne zum Laufen zu bringen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Anna','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2926,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Lage ist sehr nah am Bahnhof und nur einen kurzen Spaziergang von Garmisch & Partenkirchen entfernt. Ich hatte einige Probleme mit der deutschen Waschmaschine, aber Elsa ist ein FANTASTISCHER Gastgeber und reaktionsschneller als jeder Gastgeber, den ich je hatte. Es ist ein guter Aufenthalt in einem komfortablen Etagenbett. Würde wieder hier übernachten.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Chris','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2927,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Lage und Atmosphäre in diesem neuen Teil des Dorfes',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Antoine','https://www.airbnb.de/rooms/48268802/reviews','Juli 2022'),(2928,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich hatte einen fantastischen Aufenthalt in Elsas Haus. Es ist in bester Lage, das Zimmer ist gemütlich und sauber - es gibt auch eine Terrasse mit toller Aussicht! Sehr empfehlenswert :)',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Mayuko','https://www.airbnb.de/rooms/48268802/reviews','Juni 2022'),(2929,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa ist eine sehr nette Person. Trotz der kurzen Zeit, die ich dort hatte, war sie hilfsbereit und gesprächig. Ihre Wohnung ist so sauber und sehr gut gelegen.\nIch kann sie nur wärmstens empfehlen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Aladdin','https://www.airbnb.de/rooms/48268802/reviews','Mai 2022'),(2930,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa war extrem kommunikativ und konnte mich sehr kurzfristig unterbringen. Sehr schönes, modernes und sauberes Apartment!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Dennis','https://www.airbnb.de/rooms/48268802/reviews','April 2022'),(2931,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mein Sohn und ich fühlten uns während unseres Aufenthalts willkommen. Die Lage und die Aussicht auf dem Grundstück sind perfekt!\nWir haben großartige Empfehlungen und Informationen von Elsa erhalten. Sie gab uns sogar Frühstückssnacks.\nEs war nur eine 15-minütige Fahrt zum höchsten Punkt Deutschlands für die beste Aussicht auf den Aufzug!!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Lindsey','https://www.airbnb.de/rooms/48268802/reviews','März 2022'),(2932,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft ist fantastisch, Elsa ist eine sehr nette Gastgeberin. Die Lage ist auch toll – buchstäblich 3 Minuten vom Garmisch Hbf, 5 Minuten von der Skibushaltestelle entfernt, mit vielen schönen Restaurants, die leicht zu Fuß erreichbar sind.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Evgeny','https://www.airbnb.de/rooms/48268802/reviews','Februar 2022'),(2933,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schöne Wohnung direkt neben dem Bahnhof. Auch die tolle Aussicht ergänzt den Aufenthalt. Die Wohnung war gemütlich mit einem bequemen Sitzsack im Privatzimmer, den ich durch und durch genossen habe, während ich abends Filme schaute.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Zech','https://www.airbnb.de/rooms/48268802/reviews','Februar 2022'),(2934,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr sauberer Ort mit einer sehr herzlichen Gastgeberin! Ich habe es auch genossen, das Gästebuch zu lesen und werde auf jeden Fall wiederkommen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Tyler','https://www.airbnb.de/rooms/48268802/reviews','Februar 2022'),(2935,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr niedliche supermoderne, warme, ordentliche, saubere, organisierte Wohnung in einem schönen Gebäudekomplex (Moun10), nur wenige 