ber. Ich fühlte mich wie zu Hause. Elsa ist sehr nett und nett. Ich würde es auf jeden Fall empfehlen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/48268802/reviews','September 2021'),(2945,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa, der süßeste Gastgeber, dem ich auf Airbnb begegnet bin. Was die private Kammer angeht, ist sie 2 Minuten vom Bahnhof nach München und vom Busbahnhof zum Eisbee-See belegentlich gelegen. Wir haben unseren Aufenthalt sehr genossen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Eric','https://www.airbnb.de/rooms/48268802/reviews','August 2021'),(2946,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich habe meinen Aufenthalt wirklich genossen. Die Wohnung ist hell und ganz in der Nähe des Bahnhofs und des Stadtzentrums, Lebensmittelgeschäfte sind auch in der Nähe.\nElsa ist eine sehr angenehme Gastgeberin, mit der man sich gut unterhalten kann. Ich hoffe wirklich, dass ich wieder bei ihr übernachten werde, wenn ich das nächste Mal in Bayern bin!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Svetlana','https://www.airbnb.de/rooms/48268802/reviews','August 2021'),(2947,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ein mehrsprachiger Gastgeber im Krankenhaus, der dir gerne weiterhelfen möchte.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Jos','https://www.airbnb.de/rooms/48268802/reviews','August 2021'),(2948,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa war eine ausgezeichnete, aufmerksame Gastgeberin. Die Unterkunft ist neu gebaut und sehr sauber. Die Lage ist zentral und ich konnte überallhin zu Fuß gehen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Ari','https://www.airbnb.de/rooms/48268802/reviews','August 2021'),(2949,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr cooler Gastgeber ! Und tolles Badezimmer ! ?',4.92,NULL,0,0,'2023-08-11 